INSERT INTO `field_data_field_description` VALUES ('node','record','0','29','29','und','0','Photo of a Raza Unida Party parade in Crystal City, Texas taken by Enriqueta Chavez. Cars in the parade proceed down the street of a residential area.',null),('node','record','0','30','30','und','0','Photo of two men working on a truck decorated in red, green, and white. Beside the truck, a little girl in a pink dress dances.',null),('node','record','0','31','31','und','0','Black and white photo of newlyweds sitting on a couch.',null),('node','record','0','33','33','und','0','A float picture we are uploading',null),('node','record','0','37','37','und','0','A black and white photo of Rita Sanchez at her graduation from Stanford University in 1974.',null),('node','record','0','44','44','und','0','An Acevedo flyer for mestizaje event.',null),('node','record','0','45','45','und','0','A photo of Corky Gonzalez giving a speech. Behind him, Rita Sanchez smiles.',null),('node','record','0','46','46','und','0','Handwritten description on the backside of Rita Sanchez Graduation Photo.',null),('node','record','0','47','47','und','0','Illustrated poster for SOLART Gallery entitled El Clavo. Artwork done by John Valadez.',null),('node','record','0','48','48','und','0','A photo of Pat Zaharopoulos and two others, possibly Rita Sanchez, at a housewarming.',null),('node','record','0','49','49','und','0','A color photo of Rita Sanchez overlooking trees and homes.',null),('node','record','0','51','51','und','0','Photograph of a young Rita Sanchez with two young children and two older family members.',null),('node','record','0','52','52','und','0','A photo of five women, whose names, left to right, are Cecilia, Rita, Leota and Cecilia. They may be relatives. Photo taken at the San Bernadino Library.',null),('node','record','0','53','53','und','0',' A photo of two smiling women, one of whom is Rita Sanchez.',null),('node','record','0','54','54','und','0','Page 9 of the womens studies pamphlet, focused on ideologies and narratives reinforced in universities.',null),('node','record','0','55','55','und','0','The cover of a booklet entilted "Teatro Frontera."',null);
