INSERT INTO `field_data_field_quote_or_highlight` VALUES ('node','biographies','0','32','32','und','0','Quote or HIghlight',null),('node','biographies','0','35','35','und','0','“My whole life was around my politics, my schoolwork and being a student was secondary.” ',null),('node','biographies','0','36','36','und','0','“In order to complete my Ph.d at UCSD and  get tenure at SDSU, I had three full time jobs: full time mother; full time grad student; and full time professor.”',null),('node','biographies','0','41','41','und','0','"I was making the declaration about not just being a Mexican American. I was a Chicana. It had nothing to do with what other people said, it is my declaration and it came from me."',null),('node','biographies','0','42','42','und','0','“My parents are the ones who taught me what I know.” ',null),('node','biographies','0','43','43','und','0','“I really wanted to have a better understanding of the people that I had grown up around and the systems that I had seen oppress people.” ',null),('node','event_page','0','94','94','und','0','"Our people were incarcerated but they couldn’t break our  strike and our spirit."',null),('node','biographies','0','108','108','und','0','"I had a choice in becoming politically active in one party or another, and I chose this. I had no choice in the rest of the stuff in my life, but I had a choice here."',null),('node','biographies','0','109','109','und','0','"I wanted to make sure that Latinas had access to services just like everyone else, and the same economic opportunities as everyone else."',null),('node','biographies','0','110','110','und','0','"There is history, it didn’t just appear when you appeared. But maybe that’s what my generation is about, we are the reganionas."',null),('node','biographies','0','116','116','und','0','“The arts were crucial. They woke us up and they spoke to our hearts and they’re the true revolution.”',null),('node','biographies','0','117','117','und','0','"Something Snazzy"',null),('node','biographies','0','128','128','und','0','"Nobody knew that there was any difference among each other. We all lived in the same neighborhood, we all lived at the same level of poverty."',null);
INSERT INTO `field_data_field_quote_or_highlight` VALUES ('node','biographies','0','132','132','und','0','"Where it is hostile there''s always a little self-hate...always...because you''re just projecting out. So, I guess that is the healing part."',null),('node','biographies','0','143','143','und','0','"My upbringing had a strong dose of progressive politics."',null),('node','biographies','0','161','161','und','0','"I learned at that early age that the word ''no,'' or rejection, you can really turn it around if you''re determined to get some place."',null),('node','biographies','0','173','173','und','0','"I understand my power as a woman because I give life, I am a teacher, I am a nurturer, I provide spirituality teachings, and when we collectively come together as women, it''s such a powerful thing."',null),('node','biographies','0','196','196','und','0','“Don’t ever underestimate the power of a woman."',null),('node','biographies','0','207','207','und','0','"I am a socialist feminist because I strongly believe that everybody can someday be equal and that we can end the oppression that we as 3rd World Women as well as other oppressed groups face."',null),('node','biographies','0','224','224','und','0','"That probably was influencing why my parents were being so protective because it was the 60s, and things were changing, and they didn''t understand this world, or me, and why I was beginning to do the things I was doing."',null),('node','biographies','0','240','240','und','0','"Chicana feminism is to be yourself."',null),('node','biographies','0','251','251','und','0','"For me, you have two choices when you''re faced with things like that [racism] growing up: you either internalize it and become ashamed of who you are...or you become radicalized." "I was raising four children as a single parent in the community when I was going to funerals for kids every other week...every other week."',null),('node','biographies','0','266','266','und','0','"My mission is to be a part of elevating the image of Latinas in all media. And to me, that means reflecting a realistic image." ',null);
