INSERT INTO `field_data_field_timeline` VALUES ('node','timeline_page','0','103','103','und','0','<script src="https://ajax.googleapis.com/ajax/libs/jquery/1.12.0/jquery.min.js"></script>\r\n<script>\r\n$(document).ready(function(){\r\n    $(".clickable1").click(function(){\r\n             $(this).addClass("show1light");\r\n    }); \r\n $(".clickable2").click(function(){\r\n             $(this).addClass("show2light");\r\n    }); \r\n $(".clickable3").click(function(){\r\n             $(this).addClass("show3light");\r\n    }); \r\n $(".clickable4").click(function(){\r\n             $(this).addClass("show4light");\r\n    }); \r\n $(".clickable5").click(function(){\r\n             $(this).addClass("show5light");\r\n    }); \r\n    $(".hideclickable1").click(function(){\r\n             $(".clickable1").removeClass("show1light");\r\n    }); \r\n  $(".hideclickable2").click(function(){\r\n             $(".clickable2").removeClass("show2light");\r\n    });\r\n  $(".hideclickable3").click(function(){\r\n             $(".clickable3").removeClass("show3light");\r\n    });    \r\n  $(".hideclickable4").click(function(){\r\n             $(".clickable4").removeClass("show4light");\r\n    });    \r\n  $(".hideclickable5").click(function(){\r\n             $(".clickable5").removeClass("show5light");\r\n    });        \r\n $("#hide1").click(function(){\r\n        $("#timelinethefirst").hide();\r\n    });\r\n    $("#show1").click(function(){\r\n        $("#timelinethefirst").show();\r\n    });\r\n    $("#hide2").click(function(){\r\n        $("#timelinethesecond").hide();\r\n    });\r\n    $("#show2").click(function(){\r\n        $("#timelinethesecond").show();\r\n    });\r\n    $("#hide3").click(function(){\r\n        $("#timelinethethird").hide();\r\n    });\r\n    $("#show3").click(function(){\r\n        $("#timelinethethird").show();\r\n    })\r\n$("#hide4").click(function(){\r\n        $("#timelinethefourth").hide();\r\n    });\r\n    $("#show4").click(function(){\r\n        $("#timelinethefourth").show();\r\n    })\r\n$("#hide5").click(function(){\r\n        $("#timelinethefifth").hide();\r\n    });\r\n    $("#show5").click(function(){\r\n        $("#timelinethefifth").show();\r\n    })\r\n});\r\n</script>\r\n</head>\r\n<body>\r\n\r\n<div id="isthisworking">\r\n<p>Through the painstaking work of Dr.Maria Cotera, Linda Garcia Merchant, and the contributions of dozens of graduate and undergraduate students, we can begin situating Chicana Activism within a broader understanding of other kinds of civil rights activism. Each timeline reflects major events within an important faction of Civil Rights praxis - be that the more well-known Chicano rights movements, the second wave feminist movement, or a timeline of the Raza Unida Party''s work. We add to these more well-known histories, our own timeline of Chicana Feminist activism.</p></div>\r\n<p>&nbsp;</p>\r\n<p> Click each button to turn on that timeline. Timelines can be collapsed using the hide button next to each timeline''s title.<p>\r\n<!--button sets-->\r\n<!--click this to show button? -->\r\n\r\n\r\n<button id="show1" class="btn clickable1">All Events Timeline</button>\r\n<button id="show4" class="btn clickable2">Chicana Feminism</button>\r\n<button id="show2" class="btn clickable3">Second Wave Feminism</button>\r\n<button id="show3" class="btn clickable4">Raza Unida</button>\r\n<button id="show5" class="btn clickable5">Chicano Studies </button><p>\r\n\r\n<!--start of iframe madness -->\r\n<p><p><p>\r\n<div id="timelinethefirst" style="display:none">\r\n<h3>Timeline of Events for All Movements</h3> <button id="hide1" class="hideclickable1" style="font-size:10px" padding="5px"><i>Hide</i></button> \r\n<p><iframe align="middle" frameborder="0" height="650" scrolling="no" src="http://cdn.knightlab.com/libs/timeline/latest/embed/index.html?source=1w729IlMvrAXTueBNibctVEnC7L7a436_0d1o_0jRS7Q&amp;font=Bevan-PotanoSans&amp;maptype=toner&amp;lang=en&amp;height=650" width="80%"></iframe></p>\r\n</div>\r\n\r\n<div id="timelinethefourth" style="display:none">\r\n<h3>Chicana Feminism Timeline </h3> <button id="hide4" class="hideclickable2" style="font-size:10px" padding="5px"><i>Hide</i></button>\r\n<p><iframe align="middle" frameborder="0" height="650" scrolling="no" src="http://cdn.knightlab.com/libs/timeline/latest/embed/index.html?source=1T4S4j79Y_C1BeNePrQwbYswI4Odxa8hiBXRdFP9zRfI&amp;font=Bevan-PotanoSans&amp;maptype=toner&amp;lang=en&amp;height=650" width="80%"></iframe></p>\r\n</div>\r\n\r\n<div id="timelinethesecond" style="display:none">\r\n<h3>Second Wave Feminism</h3> <button id="hide2" class="hideclickable3" style="font-size:10px" padding="5px"><i>Hide</i></button>\r\n<p><iframe align="middle" frameborder="0" height="650" scrolling="no" src="http://cdn.knightlab.com/libs/timeline/latest/embed/index.html?source=1fQWDzCHaNYyC2g8ZSP2jhp1Zi-E6ohDnrm34BvHbTYE&amp;font=Bevan-PotanoSans&amp;maptype=toner&amp;lang=en&amp;height=650" width="80%"></iframe></p>\r\n</div>\r\n\r\n<div id="timelinethethird" style="display:none">\r\n<h3>Raza Unida</h3> <button id="hide3" class="hideclickable4" style="font-size:10px" padding="5px"><i>Hide</i></button>\r\n<p><iframe align="middle" frameborder="0" height="650" scrolling="no" src="http://cdn.knightlab.com/libs/timeline/latest/embed/index.html?source=1ohSUTDCFqK6kNrbxu4IhClkVd7ylgVMQHuHmOEeGXzo&amp;font=Bevan-PotanoSans&amp;maptype=toner&amp;lang=en&amp;height=650" width="80%"></iframe></p>\r\n</div>\r\n\r\n<div id="timelinethefifth" style="display:none">\r\n<h3>Chicano Student Movement</h3> <button id="hide5" style="font-size:10px" class="hideclickable5" padding="5px"><i>Hide</i></button>\r\n<p><iframe align="middle" frameborder="0" height="650" scrolling="no" src="http://cdn.knightlab.com/libs/timeline/latest/embed/index.html?source=1kJfRRCaW5jPyvXU-ZwFhMPNdjliT9c_43XaQNB559IQ&amp;font=Bevan-PotanoSans&amp;maptype=toner&amp;lang=en&amp;height=650" width="80%"></iframe></p>\r\n</div>','','php_code');
