INSERT INTO `field_revision_body` VALUES ('node','satellite_shared_materials','0','3','3','und','0','This is written in the body box. CPMR instructions, last updated May 2014.','','filtered_html'),('node','page','0','10','10','und','0','<p><strong>Medici can be accessed via the portal below. If you are not an affiliated user you may browse with limited editing and downloading privileges using the following credentials:</strong></p>\r\n\r\n<p>User Name: 2014cpmr@gmail.com</p>\r\n\r\n<p>Password: cpmr2014</p>\r\n\r\n<p>You can apply for an account with more access and use privileges by completing this *form*</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><iframe height="750" src="http://medici-michigan.ncsa.illinois.edu/#collection?uri=tag:cet.ncsa.uiuc.edu,2008:/bean/Collection/3FA8ABB0-0250-4C92-9202-2CC3ABB1FB3B" width="1000"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n','','full_html'),('node','page','0','13','13','und','0','<p><span style="font-size:14px"><span style="color:#B22222"><strong>What is Chicana por mi Raza?</strong></span></span></p>\r\n\r\n<p>Chicana por mi Raza: Uncovering the Hidden History of Chicana Feminism (1965‐1985) is a public humanities project centered on the collection and digital preservation of archival materials, ephemera, and oral histories that document the development of Chicana feminist thought during the civil rights era. The overarching objective of the project is to provide broad‐based public access to oral histories, material culture, correspondence, and rare out‐of‐print publications for use in both scholarly research and the classroom.</p>\r\n\r\n<p><strong>Collection Details</strong></p>\r\n\r\n<p>Chicana por mi Raza began collecting oral histories in 2009. Since then, the CPMR team has interviewed more than 52 women. From these interviews we''ve collected and processed approximately <strong>1500 archival items</strong>, with another 1000 or so awaiting digitizing, description and uploading. Most of the oral histories consist of several hours of film footage, and some women have been interviewed more than once. <strong>Our online digital repository currently contains approximately 1400 available digital records and over 439 interview clips.</strong></p>\r\n\r\n<p>Women''s collections that are currently available on Medici as of January 2015 include:</p>\r\n\r\n<ul>\r\n	<li>Alicia Escalante&nbsp;</li>\r\n	<li>Alma Canales</li>\r\n	<li>Anna NietoGomez&nbsp;</li>\r\n	<li>Barbara Carrasco&nbsp;</li>\r\n	<li>Barbara Medina&nbsp;</li>\r\n	<li>Blanca Vargas&nbsp;</li>\r\n	<li>Carmen Tafolla&nbsp;</li>\r\n	<li>Cecilia Preciado Burciaga&nbsp;</li>\r\n	<li>Clementina Carmona Olloque&nbsp;</li>\r\n	<li>Consuelo Castañuela&nbsp;</li>\r\n	<li>Corinne Sanchez&nbsp;</li>\r\n	<li>Cynthia Perez&nbsp;</li>\r\n	<li>Elena Herrada&nbsp;</li>\r\n	<li>Elena Mulcahy&nbsp;</li>\r\n	<li>Elizabeth Betita Martinez&nbsp;</li>\r\n	<li>Eloisa Gomez&nbsp;</li>\r\n	<li>Emily Martinez&nbsp;</li>\r\n	<li>Enriqueta Chavez&nbsp;</li>\r\n	<li>Gloria Arellanes&nbsp;</li>\r\n	<li>Idali Feliciano&nbsp;</li>\r\n	<li>Jane Garcia&nbsp;</li>\r\n	<li>Jose Guadiana&nbsp;</li>\r\n	<li>Linda del Toro&nbsp;</li>\r\n	<li>Linda Garcia Merchant&nbsp;</li>\r\n	<li>Lupe Anguiano&nbsp;</li>\r\n	<li>MABPW Project&nbsp;</li>\r\n	<li>Margaret Cruz&nbsp;</li>\r\n	<li>Maria Cotera&nbsp;</li>\r\n	<li>Maria Cuca Carmona&nbsp;</li>\r\n	<li>Maria D Jimenez&nbsp;</li>\r\n	<li>Maria D''Amezcua&nbsp;</li>\r\n	<li>Maria Estela Najar&nbsp;</li>\r\n	<li>Maria Guadiana&nbsp;</li>\r\n	<li>Maria Rodriguez&nbsp;</li>\r\n	<li>Maria Serrano&nbsp;</li>\r\n	<li>Maria Varela&nbsp;</li>\r\n	<li>Martha Cotera&nbsp;</li>\r\n	<li>Mary Gonzales Koenig&nbsp;</li>\r\n	<li>Modesta Trevino&nbsp;</li>\r\n	<li>Nancy De Los Santos Reza&nbsp;</li>\r\n	<li>Olivia Puentes Reynolds&nbsp;</li>\r\n	<li>Patricia Villareal&nbsp;</li>\r\n	<li>Rita Sanchez&nbsp;</li>\r\n	<li>Rita Tenorio&nbsp;</li>\r\n	<li>Rose Marie Roybal&nbsp;</li>\r\n	<li>Rose Mary Bombela Tobias&nbsp;</li>\r\n	<li>Rosie Castro&nbsp;</li>\r\n	<li>Ruth Mojica Hammer&nbsp;</li>\r\n	<li>Sissy Farenthold&nbsp;</li>\r\n	<li>Sister Melanie Maczka&nbsp;</li>\r\n	<li>Sonia Lopez&nbsp;</li>\r\n	<li>Third World Women''s Alliance&nbsp;</li>\r\n	<li>Virginia Gomez Oviedo&nbsp;</li>\r\n	<li>Virginia Martinez&nbsp;</li>\r\n	<li>Virginia Ortega&nbsp;</li>\r\n	<li>Yolanda Alaniz&nbsp;</li>\r\n	<li>Idali Feliciano&nbsp;</li>\r\n	<li>Virginia Ortega&nbsp;</li>\r\n</ul>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','page','0','17','17','und','0','<p><img alt="" class="Image img__fid__9 img__view_mode__media_original media-image" src="http://localhost:8888/htdocs/drupal/modules/media/images/icons/default/video-x-generic.png" /></p>\r\n','','filtered_html'),('node','page','0','18','18','und','0','<p><img alt="" src="http://www.youtube.com/watch?v=6cfCgLgiFDM" /></p>\r\n','','full_html'),('node','satellite_shared_materials','0','22','22','und','0','<p>Community Stories at Southwestern University took place in the fall of 2014. After inviting project founders Maria Cotera and Linda Garcia-Merchant to lecture, and attending a training by digital archivist Maria Seiferle-Valencia, Brenda Sendejo undertook her own version of community stories. Her students recorded and edited oral histories, scanned archives, and adapted the guidelines to meet the unique needs of this undergraduate class.</p>\r\n','','filtered_html'),('node','satellite_shared_materials','0','23','23','und','0','<p>Test to see where this content type is at in development.</p>\r\n','','filtered_html'),('node','satellite_project','0','27','27','und','0','<p>This is a content type for Satellite Projects.</p>\r\n','','filtered_html'),('node','page','0','28','28','und','0','<div id="containers"><img src="/htdocs/drupal/sites/default/files/larazaunida.jpeg" /> <img src="/htdocs/drupal/sites/default/files/blur1.jpg" /></div>','','full_html'),('node','biographies','0','32','32','und','0','<p>Enriqueta Chavez has had a life full of meaningful work in her community. From teaching to serving as a life-changing guidance counselor, Chavez engaged with youth, encouraging pride in their Chicano heritage. Chavez emphasizes the importance of maintaining an open mind, being true to oneself, and speaking up against injustice.</p>\r\n\r\n<p>Chavez was born in Tucson, Arizona. Her father’s family had lived in Arizona for generations; her mother was from Mexico. Chavez grew up in what she deems a traditional family; her mother stayed at home to care for Enriqueta and her sisters while her father worked different jobs, as a mechanic, highway worker, or a field worker. They were not wealthy; in the summer, Chavez’s whole family went to Fresno to pick grapes in the fields. Although Chavez remembers these parts of these summers fondly – she liked spending time with family – she also recalls the challenges of the working conditions. Often, there was no drinking water and no toilets on the fields, and planes would spray the grapes even while workers were picking.</p>\r\n\r\n<p>Chavez worked picking grapes in the summer until she was around 14 years old. After that, she decided she never wanted to do physical labor again. Instead, she began working hard at school, pushing herself to succeed academically. It wasn’t easy – there wasn’t a single Chicano teacher at school, and she experienced racism throughout her education. For example, her kindergarten teacher changed her name from Enriqueta to Henrietta, a change that lasted throughout her education, much to her frustration. Despite obstacles, Chavez thrived at school, graduating in the top 10% of her class. She hadn’t thought much about college; her father had a 6<sup>th</sup> grade education, and her mother had a 5<sup>th</sup> – but at the encouragement of a friend’s parent, Chavez applied and was accepted to San Diego State in 1968. She had to work hard to convince her parents to let her go; they preferred that she stay at home to get married, but Chavez knew she wanted a better quality of life.</p>\r\n\r\n<p>Although she was homesick her first year of college, Chavez found a family away from home with MAYA, a student organization that later changed its name to MEChA. Through her experiences with MAYA, Chavez discovered more about her Chicana identity, racism, and injustice. At the same time, she became aware of gender disparities in the Chicano movement – women were relegated to secretarial roles, whereas men led the meetings. Chavez was outspoken about her dissonance with these roles. She started learning about the history of women and oppression, both in the United States and abroad. She educated fellow female students about health, especially reproductive health and birth control, attended conferences around the country and world, and spoke up for better treatment of both Chicanos and women. She was deeply involved with several Chicano groups on campus, as well as studying hard in her double major of Health and Chicano Studies. On top of this, Chavez got married in 1969, her second year of college, and had a baby, fighting a battle on her home front against having to cook for her husband (a battle which she won).</p>\r\n\r\n<p>After graduation from San Diego State, Chavez stayed in San Diego to get a Master’s in Counseling. She went on to get a job in a school district, where she enacted considerable social change. She stayed in the same district for the next 32 years. She first worked with middle school students who were performing three or more years behind grade level, trying to build their self-esteem. Later, she moved to Sweetwater, a majority Latino high school, where she remained for 17 years. When she began her work, only around 10% of her students went to college; because of Chavez’s influence, around 90% of her students went to college. Chavez did workshops with other counselors on how to work with Latino students, conducted SAT prep lessons for students on the weekends, and sat on the College Board for SAT preparations.</p>\r\n\r\n<p>When a new high school opened, Chavez was the second person to be hired, and she wrote the curriculum for many of the high school’s classes. She developed the high school’s AP and honors programs, and hosted events for Latinas and Latinos at school, including cotillion balls, mariachi and folklorico programs, and a high school chapter of MEChA. She was especially involved with MEChA, focusing on empowering her students and bringing in speakers. For the last four years of her work, Chavez was in charge of all the counselors in the district.</p>\r\n\r\n<p>Chavez leads a full, multicultural life. She is well traveled, having been selected to visit Japan for 15 days, selected to visit China for 15 days, and taken a group of students to Europe for more than two weeks. She counts herself as lucky to have had such a wide range of experiences during her life, which, she says, made her a better person. Chavez values having an open mind, speaking up against injustice, and being honest about her beliefs. Although she says she is no longer involved with political movements, Chavez is vocal about standing up for what is right. She currently sits on several boards to represent underrepresented students who are going to college.</p>\r\n','<p>Enriqueta Chavez is one bad ass lady.</p>\r\n','full_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','35','35','und','0','<p>Sonia Lopez was born in Sonora, Mexico. She immigrated at a young age to the United States, moving to Imperial Valley before settling in Calexico, a border town in California.</p>\r\n\r\n<p>Lopez had a difficult childhood. Poverty controlled her life; her family didn’t have indoor plumbing, and in her interview, she struggles to hold back tears as she describes how it felt to come to school wearing other student’s hand-me-downs. Lopez’s father, an alcoholic, worked as a mechanic for farm machinery; her mother worked at local stores. With both parents out of the house, much of the housework and childcare fell on Lopez’s shoulders.</p>\r\n\r\n<p>However, Lopez cites these difficulties as catalyst for change. In her interview, she says, “Living in poverty and knowing how much it hurts motivated me to say, I don’t want to be poor” (9:54). Because she wanted to escape poverty, Lopez worked hard to graduate from high school. Then, while most of her friends dreamed about getting married, Lopez set her sights on college. She attended community college before going to San Diego State through the Equal Opportunities Program in 1968.</p>\r\n\r\n<p>It was in college that Lopez began to get involved with activism. College was a culture shock; she experienced stereotyping, and felt isolated and alone on campus. Joining MEChA completely changed her experience. She became, in her own words, a “political animal,” attending meetings all day, traveling across the state, and developing a Chicano Studies program. While involved with MEChA, Lopez became frustrated with the strict gender roles within the organization. Women were tasked with traditionally female jobs, like answering phones and cooking for the male members, all while being subjected to men’s predatory advances. While being a “feminist” had negative connotations, Lopez and her friends began to fight against these traditional gender roles; as Lopez says, “We were becoming feminists but not saying that we were becoming feminists” (2:37).</p>\r\n\r\n<p>Lopez’s political involvement opened doors, but it also limited her ability to be a student. In 1970, she left San Diego State, putting schoolwork secondary to politics, and traveled around the country advocating for Chicana/o rights with figures like Corky Gonzalez, Reyes Lopez Tijerina, both of whom she openly challenged about sexist remarks. She later went to Sacramento to finish her coursework. When she finished school, Lopez returned to Calexico to help with a brother who was struggling with addiction, and remained in Calexico for several years, working as a counselor in the high school and as a campaign manager for a friend in 1975.</p>\r\n\r\n<p>Lopez went on to teach as a professor, first at San Diego State, and then at Fullerton State. She also attended law school. Through studying law, Lopez became passionate about immigration reform, and began to work with undocumented youth. She remains active in Chicana/o rights, and acknowledges the positive social change she and other women have created. Lopez wants her experiences to help tell the story of many women who, forgotten by history, made a real difference in the Chicana/o movement.&nbsp;</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','36','36','und','0','Rita Sanchez was born and brought up in San Bernardino, California, seventh of eleven children. Her parents and their parents were from New Mexico, which had been home to her family for generations. Her ancestors were, in her words, the “first mestizos,” because of intermarriage between Spanish and Indian. This history, Sanchez points out, was the beginning of her “Chicana coming-to-consciousness,” the pride in her heritage, a tradition that she has celebrated throughout her life. \r\n\r\nIn her interview, she also takes pride in the way her parents raised eleven children. Sanchez grew up in a working class family. She recalls that she and her siblings did not wear shoes during the summer so that they wouldn’t wear them out for school. To her, those summers were about family: playing outdoors in fields that surrounded their home; stacking bales of hay into play houses with her brother and sisters; and watching her dad and brothers care for horses he raised. “I also remember my father and five brothers planting fields of crops, corn on one side and boysenberries on the other, she said. “We didn’t have much money but we did not consider ourselves poor. My mother and father always put food on the table.” In the realm of education, however, she noticed the discrepancies. For example, her high school counselor told her not to think about college, and encouraged her to take secretarial courses instead. She advised, “Don’t plan on going to college. Your parents can’t afford it.” Luckily, not everyone in Sanchez’s life gave such pessimistic advice. \r\n\r\nIn 1956, Sanchez was editor of the high school weekly newspaper, and her journalism teacher paid special attention to her because of her writing abilities. He encouraged her to apply for college. He also helped her apply for and win a financial scholarship, a competitive journalism award given by the local newspaper. She won first place. \r\n\r\nBesides her teacher’s encouragement, Sanchez credits her five sisters, especially three older ones for her applying to college. She was not the first. In 1953, her sister Mary was a California Girl’s State leader who got to travel to Sacramento to attend a high school conference. At the local college, she was editor of the yearbook. However, Rita was the first one to go away and her father was especially resistant to her decision. In 1956, with the help of her sisters, however, she convinced her father to allow her to enroll at San Jose State University to study journalism. \r\n\r\nFreshman year was not automatically easy for Sanchez. Although she enjoyed her courses, she was alone most of the time, living with an Anglo family in a room away from campus with no guests allowed. A boy in her school saw her, invited her out; they fell in love and married the next year, against her family’s advice. “My mother reminded me that I was raised Catholic and he was not.” Much to her father’s disapproval, she dropped out so that she could work full time in order to finance her husband’s education, including law school, and a move to San Francisco. Living in a flat in a strange city, while her husband attended law school, worked, and studied nights, she missed her large family. “I thought I was being the altruistic woman I was expected to be; but besides that, I thought I knew it all, and so did not stop to listen to my family.” She also had two daughters, with all of the joy that came with them, but then came the pangs of isolation, raising them alone much of the time. As a working mother, and with plenty of guilt, Sanchez decided to return to school, one course at a time. Despite her sacrifices, her husband, now an attorney, questioned her choices, especially when it interfered with household duties; when she protested his judgments—challenging gender roles, and his long hours of absence from the home—their marriage ended. After ten years of marriage, they divorced. \r\n\r\nIn 1969, Sanchez got custody of their daughters and, broken hearted, went back to school. According to her interview, she “walked right into the Chicano/a movement.” As she became more involved in a community of people dialoguing about their civil rights, she became engaged in political activism. “I began to care about other people, rather than feeling sorry for myself; besides, they felt like family to me. I also began to understand the double standards I had faced, as well as my own immaturity.” \r\n\r\nAs a young mother, she realized she had been trying to understand these conditions on her own. She also met people who believed in her abilities. She worked hard to get good grades, transferred to Stanford University, changed her degree from journalism to English, so she could teach, and joined Chicano student groups on campus. Professor Arturo Islas, her advisor, invited her to join a campus committee called “Assistant to the President for Chicano Affairs.” This advisory to the president of the university was the result of hundreds of African Americans and Mexican Americans entering college for the first time since the Civil Rights Act of 1964. We were also the committee that hired Cecilia Burciaga, assistant to the president. Working on the committee led to a whole new perspective that changed the course of her life. In 1973, she applied for the Chicano Fellows Award, given as a result of a proposed academic project. The first woman, Sanchez proposed teaching a writing course to incoming Chicano students arriving at the university for the first time; and a course for women she called “Mujer de la Raza,” a title after Antonia Castaneda’s Chicana course at the University of Washington in the 1960s. Sanchez edited for publication the student writings from the women’s course she taught that year. \r\n\r\nAt Stanford she received two Masters degrees. She got a Master’s in Education; and, soon after, a Master’s in English Literature. In 1974, she was hired at San Diego State to teach English, the first tenure-track woman in the department of Chicana and Chicano Studies. In order to be tenured she had to be in a Ph.D program. She was accepted at UCSD with a Ford Foundation Fellowship–now incredibly busy, but passionate about all aspects of her life. In 1976, she still had a drive to organize a Chicana course, and to act as editor of a Chicana journal, Vision, upholding the idea that “writing is a revolutionary act,” from a talk she gave as one of a few Chicanas at a Latin American Women Writers Conference at San Jose State in 1976. She also recalls another time she presented at the UC Berkeley First Annual Chicana Conference with two others, one of whom was Anna NietoGomez. In 1977, she met her second husband, Mario Torero, an artist, and had two more children. She was, in her own words, a “full-time mother, a full-time teacher, and a full-time student.” \r\n\r\nIn 1983, when she was given a terminal year at SDSU because she had not completed her Ph.d. she instead became more entrenched in the arts and political communities. Together, Sanchez and Torero opened up the Acevedo gallery, where she worked for eight years and where Sanchez successfully sold Chicano art. After twelve years of marriage, they went their separate ways and Sanchez returned to teaching. \r\n\r\nIn 1990, Sanchez was hired in a joint position with the English department and the department of Chicana/Chicano Studies at Mesa College, the first full-time Chicana professor to be hired since the department began in 1970s. She moderated a Chicana Literary Symposium designed by her colleagues who had hired her. It included Ana Castillo, Lucha Corpi, and Alma Luz Villanueva. Sanchez eventually became the first Chicana to chair the department; she has been responsible herself for bringing such dignitaries to campus as Dolores Huerta, Gracia Molina de Pick; and giving a special homage to Elizabeth ‘Betita’ Martinez. She has given several presentations inviting her colleagues to join her. One of them for Womens History Month was “Writing Maria Amparo Ruiz de Burton Into American Literature,” a contemporary of the greats, Helen Hunt Jackson and Harriet Beecher Stowe. Sanchez published other works, including “The Five Sanchez Brothers,” Mexican Americans & World War II, (Ed. Maggie Rivas-Rodriguez. Austin: UTexas Press, 2005). However, she will always be best known for her 1976 “Writing as a Revolutionary Act” essay, republished as “Chicana Writer Breaking Out of Silence,” in Chicana Feminist Thought: The Basic Historical Writings (Ed. Alma M. Garcia. New York: 1997). \r\n\r\nRita Sanchez, Professor Emerita, is happily remarried and lives in San Diego with her husband of twenty years, Richard Griswold del Castillo; they have six children between them and nine grandchildren. Sanchez continues to write and make art as a way to create positive social change. Presently she is gathering the stories of local Chicanas. In 2011, surrounded by her family and children, she was inducted into the San Diego Women’s Hall of Fame in the area of “Activist.”','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','article','0','39','39','und','0','<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n','','filtered_html'),('node','page','0','40','40','und','0','<p><strong>Bibliographic References and Secondary Sources</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Resources for Teachers</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Resources for Site Partners</strong></p>\r\n\r\n<p>&lt;links to guides etc&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="http://www.chicanapormiraza.org/node/103"><strong>Timelines of Chicana Feminism</strong></a></p>\r\n\r\n<p>In development.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','','full_html'),('node','biographies','0','41','41','und','0','<p>Olivia Puentes Reynolds sits for her interview with a guitar on her knee. Hers is a story of music and mythology, her activism inspired by poetry. Reynolds’ archive of health reports and radical newsletters is peppered with songs and drawings, complete with an entire <em>teatro frontera </em>booklet. Throughout her life, Reynolds combined art, music, and writing to stand up for social change.</p>\r\n\r\n<p>Olivia Puentes Reynolds was born to a mixed-race family – her mother Chicana, her father Irish, English, and Cherokee. While she speaks about loving her mixed-race heritage, Reynolds says she always identified as Chicana, even though she grew up speaking English as her first language. Reynolds did not have an easy childhood; she mentions experiencing domestic abuse, as well as discrimination for being a person of color. She found comfort in music, learning to play guitar at the age of 18 and continuing to play music for the rest of her life.</p>\r\n\r\n<p>Reynolds started her journey with higher education at Mesa Community College. She discusses struggling at community college because she was surrounded by wealthy, white students with whom she struggled to identify. At community college, Reynolds became involved with Mexican-American student organizations. She then transferred, through the Equal Opportunities Program, to San Diego State. Reynolds is honest about her struggle with identity while at college. She discusses how she didn’t want to identify as “Mexican,” even though she found Mexican-American student organizations to be a great source of support. To her, “Mexican” was a dirty word. She had to confront her own internalized oppression and feeling ugly to come into self-love and believing that brown is beautiful.</p>\r\n\r\n<p>While at college, Reynolds began noticing oppression based on both her race and gender. She describes her “click” moment of realizing gender inequality as being in a Chicano student meeting. She voiced an idea, and no one took it seriously; when a male colleague repeated the same idea, everyone responded well. Reynolds describes the frustration surrounding these types of encounters, though she also notes how “dangerous” it was to call oneself a feminist; not only did people take you less seriously, she says, but also men weren’t attracted to feminists. Reynolds doesn’t seem to mind these negative connotations; she says she is “done with Chicano men forever” because of their macho attitudes.</p>\r\n\r\n<p>A pinnacle moment for Olivia Puentes Reynolds’ activism was when she read her poem, “I heard black is beautiful,” aloud at the Denver youth conference in 1969. Reynolds was 19 years old, very pregnant, and desperately nervous, but she got onstage and read her poem because, as she says, she was used to the unfair treatment of women and wanted to stand up for women as contributors to the Chicano movement. The poem is about wanting to feel beautiful as a brown woman in a world where attention is most often given to white voices. She received a standing ovation from the audience.</p>\r\n\r\n<p>Reynolds continues to be active in advocating for women’s rights. Her work now is focused on sexual assault and rape. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','42','42','und','0','<p>Emily Martinez was born in Texas in 1939, and moved to&nbsp;Blissfield, Michigan as a child.&nbsp;The oldest of ten children, Martinez came from a family with a long history of working as migrant farmers. Although her grandparents and parents grew up following the crop from La Feria, Texas to northern Michigan, Martinez’s parents ultimately settled in Blissfield in 1948 to raise their family. In transitioning from being migrant farmworkers to seasonal workers, Martinez’s family experienced racial discrimination in school, in attempting to purchase a home in a white neighborhood, and at work. Martinez, who was one of the first Hispanic students to graduate from Blissfield High School in 1959, stood up for oppressed groups in all of these spaces, including the women in the steel factory in which she worked.</p>\r\n\r\n<p>Emily Martinez married Henry Navarro Martinez in 1963, and together they had five children. She continued working in the steel industry until the job became too dangerous. Having always wanted to work with disabled children, Martinez found new employment at the Lenawee Independent School District in 1970. While she was working, she also took classes, and was certified by the Red Cross as a nurse, although she never completed her degree. Martinez devoted her time and energy into teaching students with disabilities and the children of migrant farmworkers, working to help show these historically marginalized students what they were capable of.&nbsp;</p>\r\n','','filtered_html'),('node','biographies','0','43','43','und','0','<p>Elena Herrada was born on March 28, 1957 in Detroit, Michigan. She attended Wayne State University in Detroit, becoming involved with activism and Chicano Boricua studies. She graduated in 1980 with a degree in Criminal Justice and a major in Chicano Boricua Studies. Her motivation to graduate partially stemmed from her grandfather, who attended her graduation wearing full revolutionary regalia, shouting, “Viva Herrada!”</p>\r\n\r\n<p>Several of Elena Herrada’s archival documents include references to Gilbert Gutierrez, Herrada’s old boyfriend. Gutierrez was killed in 1977, and Herrada participated in his trial. Herrada cites Gutierrez as the reason she studied Criminal Justice in college.</p>\r\n\r\n<p>Much of Herrada’s later activism stemmed from the concept of “Los Repatriados,” the Repatriated. The Repatriated refers to the history of Mexican immigrants who were encouraged to move to the U.S. to work in bracero programs, only to be deported in massive numbers during the Depression, serving as a scapegoat for U.S. economic issues. Many Mexicans and their U.S.-born children moved back to Mexico, often to lead impoverished lives. Herrada’s family experienced this history, being forced to move to Mexico in 1930, and then returning to Detroit in 1932. Herrada’s research and activism surrounds raising awareness of this history through screening documentaries, collecting oral histories, and hosting events to raise awareness about Los Repatriados.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','event_page','0','94','94','und','0','<p><strong>Early Years</strong></p>\r\n\r\n<p>Sonia Lopez was born in Sonora, Mexico. She immigrated at a young age to the United States, moving to Imperial Valley before settling in Calexico, a border town in California.</p>\r\n\r\n<p>Lopez had a difficult childhood. Poverty controlled her life; her family didn’t have indoor plumbing, and in her interview, she struggles to hold back tears as she describes how it felt to come to school wearing other student’s hand-me-downs. Lopez’s father, an alcoholic, worked as a mechanic for farm machinery; her mother worked at local stores. With both parents out of the house, much of the housework and childcare fell on Lopez’s shoulders.</p>\r\n\r\n<p>However, Lopez cites these difficulties as catalyst for change. In her interview, she says, “Living in poverty and knowing how much it hurts motivated me to say, I don’t want to be poor” (9:54). Because she wanted to escape poverty, Lopez worked hard to graduate from high school. Then, while most of her friends dreamed about getting married, Lopez set her sights on college. She attended community college before going to San Diego State through the Equal Opportunities Program in 1968.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>College Activism</strong></p>\r\n\r\n<p>It was in college that Lopez began to get involved with activism. College was a culture shock; she experienced stereotyping, and felt isolated and alone on campus. Joining MEChA completely changed her experience. She became, in her own words, a “political animal,” attending meetings all day, traveling across the state, and developing a Chicano Studies program. While involved with MEChA, Lopez became frustrated with the strict gender roles within the organization. Women were tasked with traditionally female jobs, like answering phones and cooking for the male members, all while being subjected to men’s predatory advances. While being a “feminist” had negative connotations, Lopez and her friends began to fight against these traditional gender roles; as Lopez says, “We were becoming feminists but not saying that we were becoming feminists” (2:37).</p>\r\n\r\n<p>Lopez’s political involvement opened doors, but it also limited her ability to be a student. In 1970, she left San Diego State, putting schoolwork secondary to politics, and traveled around the country advocating for Chicana/o rights with figures like Corky Gonzalez, Reyes Lopez Tijerina, both of whom she openly challenged about sexist remarks. She later went to Sacramento to finish her coursework. When she finished school, Lopez returned to Calexico to help with a brother who was struggling with addiction, and remained in Calexico for several years, working as a counselor in the high school and as a campaign manager for a friend in 1975.</p>\r\n\r\n<p>&nbsp;</p>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','page','0','97','97','und','0','<h2 dir="ltr"><strong><em>Groups and Organizations</em></strong></h2>\r\n\r\n<div dir="ltr"><strong>The Chicana por mi Raza Digital Memory </strong>is always interested in developing new partnerships with organizations, libraries, research institutions and individuals who wish to collaborate in the collection and preservation of stories, archives, and written work documenting the development of Chicana feminist praxis in the 1960s, 1970s and 1980s.</div>\r\n\r\n<div dir="ltr">There are many avenues for potential collaboration. Community organizations with archival materials can work with local colleges and universities to conduct oral histories with elder members and scan their materials. Such projects can also be undertaken independently, without the assistance of local educational institutions. The Chicana por mi Raza Digital Collective has developed a set of guidelines, best practices, and work flows to help community organizations undertake their own histories, using the Chicana por mi Raza Digital collection as a repository for collected materials. If you would like to undertake a community history project, and are interested in working with us to make it happen, please contact the Project director:&nbsp;<a href="mailto:mcotera@umich.edu?subject=I%20would%20like%20to%20work%20with%20CPMR">Dr. Maria Cotera</a></div>\r\n\r\n<h2 dir="ltr"><em><strong>Instructors</strong></em></h2>\r\n\r\n<p dir="ltr">There are many ways for instructors to partner with the Chicana por mi Raza Digital Memory project—from developing courses and assignment structures using our materials, to creating content for our public website, to undertaking a local oral history/archival collection project as part of the class. The Chicana por mi Raza Digital Collective has developed a host of teaching materials to assist educators including course syllabi, reading lists, assignment structures, and guidelines for scanning, cataloging and working with the Medici System (our database).&nbsp;If you would like to use materials from our digital repository in your class, or even undertake a community history project, and are interested in working with us to make it happen, please contact the Project director:&nbsp;<a href="mailto:mcotera@umich.edu?subject=I%20would%20like%20to%20work%20with%20CPMR">Dr. Maria Cotera</a></p>\r\n\r\n<h2 dir="ltr"><em><strong>Individual Scholars</strong></em></h2>\r\n\r\n<div dir="ltr">Scholars interested in working in our digital repository, must first contact the project director, &nbsp;<a href="mailto:mcotera@umich.edu?subject=I%20would%20like%20to%20work%20with%20CPMR">Dr. Maria Cotera</a>, and accept our terms of use agreement.</div>\r\n\r\n<div>\r\n<h2 dir="ltr"><span style="color:#800000"><u><strong>Current Partners</strong></u></span></h2>\r\n\r\n<p dir="ltr"><em><strong>Somos Latinas Wisconsin Oral History Initiative</strong></em><br />\r\nDr. Andrea "Tess" Arenas, Director<br />\r\n​Linda Garcia Merchant, Technical Advisor</p>\r\n\r\n<p dir="ltr"><em><strong>Chicana Chicago</strong></em><br />\r\nDr. Elena Gutierrez, Faculty Director<br />\r\nLinda Garcia Merchant, Technical Advisor</p>\r\n\r\n<div>&nbsp;</div>\r\n</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<hr />\r\n<h2 dir="ltr"><span style="color:#800000"><u><strong>Terms of Use</strong></u></span></h2>\r\n\r\n<p dir="ltr">All persons wishing to use materials from the Chicana por mi Raza Digital Collection must agree to join the Chicana por mi Raza Digital Memory Collective. Members of the collective are granted access to the materials in the collection with the understanding that they will contribute in some way to the goals of the Chicana por mi Raza project.&nbsp;</p>\r\n\r\n<p dir="ltr"><em><strong>Contributions might include:</strong></em></p>\r\n\r\n<ul>\r\n	<li dir="ltr">\r\n	<p dir="ltr">Adding to the collection: digital images, oral histories, and/or scholarly essays.</p>\r\n	</li>\r\n	<li dir="ltr">\r\n	<p dir="ltr">Developing digital curations, storytelling projects, short films and essays related to research conducted using materials from the collection, with the understanding that these scholarly products will be featured on the Chicana por mi Raza Digital Memory Collective public website.</p>\r\n	</li>\r\n	<li dir="ltr">\r\n	<p dir="ltr">Writing collection guides, biographies, and other supplementary material that will assist users of the collection, with the understanding that these scholarly products will be featured on the Chicana por mi Raza Digital Memory Collective public website.</p>\r\n	</li>\r\n	<li dir="ltr">\r\n	<p dir="ltr">Developing pedagogical materials, teaching models, &nbsp;guides, &nbsp;assignment structures and research project ideas that will assist educators in their use of the site within diverse classroom settings. These materials will be made available on the Chicana por mi Raza Digital Memory Collective public website.</p>\r\n	</li>\r\n	<li dir="ltr">\r\n	<p dir="ltr">Maintaining and Improving the collection (cleaning up tags, adding descriptive information).</p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir="ltr"><em>Members of the CPMR Collective may use the materials in the collection for their teaching and research.</em></p>\r\n\r\n<p dir="ltr">Before publishing, performing, displaying, or broadcasting a photograph, audio, musical work, motion picture, or audiovisual work except according to the conditions of Fair Use, the researcher is responsible for securing permission from the rights holder and for ensuring that the work carries a credit line stating: “Courtesy of the CPMR Digital Memory Collective.”</p>\r\n\r\n<p dir="ltr">Note: actual determination of whether a use in any particular case is a “fair use” is a matter for a court to decide. Further information can be found at:&nbsp;<a href="http://www.copyright.columbia.edu/fair-use-checklist">http://www.copyright.columbia.edu/fair-use-checklist</a>.</p>\r\n\r\n<div>\r\n<p dir="ltr">&nbsp;</p>\r\n\r\n<p dir="ltr">&nbsp;</p>\r\n</div>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','events','0','99','99','und','0','<p><em>Text appears courtesy of <a href="https://www.utexas.edu/">www.utexas.edu</a>.</em></p>\r\n\r\n<p>The Center for Mexican American Studies (CMAS) at The University of Texas at Austin and the Society for the Study of Gloria Anzaldúa (SSGA) invite you to: El Mundo Zurdo 2015: Memoria y Conocimiento: Interdisciplinary Anzalduan Studies—Archive, Legacy, and Thought. The conference will take place May 27-30, 2015 at UT Austin.<br />\r\n<br />\r\nTen years ago, UT Austin organized and hosted a memorial for Gloria Anzaldúa in commemoration of her life and work. Activists, artists, and academics from across the country participated in the celebration of Anzaldúa’s legacy. Following her passing, LLILAS-Benson Latin American Studies and Collections became the repository of the "Gloria Evangelina Anzaldúa Papers, 1942-2004." Scholars and activists travel from around the globe to work with Anzaldúa’s personal papers, which include "correspondence, written works, audio tape interviews, reviews, clippings, photographs, posters, artwork, and collected materials."&nbsp;<br />\r\n<br />\r\nIn addition to a rich range of academic panels engaging this archive and Anzaldúa''s work more broadly, the 2015 conference will feature:</p>\r\n\r\n<ul>\r\n	<li>An Archive Workshop at LLILAS-Benson with Dr. AnaLouise Keating</li>\r\n	<li>An Opening Plenary by Dr. Maria Cotera</li>\r\n	<li>A Featured Roundtable with former LLILAS-Benson Fellows</li>\r\n	<li>A Plenary Roundtable with Dr. Marisa Belausteguigoitia Ruis, Dr. Maria Lugones, and Dr. Smadar Lavie</li>\r\n</ul>\r\n\r\n<p>El Mundo Zurdo 2015 is free and open to the public, which is made possible through the sponsorship of the Center for Mexican American Studies, the Department of Mexican American and Latina/o Studies (MALS), and LLILAS-Benson.<br />\r\n&nbsp;<br />\r\nVisit the following URL for more information on the&nbsp;<a href="http://www.utexas.edu/cola/centers/cmas/anzald%C3%BAa-conference-2015/preliminary-program.php" target="_blank">conference program</a>.<br />\r\n<br />\r\nWe look forward to seeing you at the conference. You can also follow the conversation on Twitter at #Anzaldua15.</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','108','108','und','0','<p>Jane Garcia was born in Detroit, Michigan in 1948. She attended public and parochial schools, and is a graduate of Wayne State Community College. She is a licensed social worker, a former cosmetologist, and a constant advocate for positive social change in Detroit. Garcia has spent decades working for the United States Bureau of the Census, focusing on the Midwestern Hispanic population. Throughout her life, she also worked in Detroit Public Schools; with SER-METRO-DETROIT; with Latino Mental Health Outreach; and has served as a volunteer director of LA SED (Latin Americans for Social and Economic Development.) Additionally, Garcia is active within the Republican Party, and in 1982, was the first Hispanic person ever elected Vice Chair of the Michigan Republican Party. She and her husband Enrique have five children.</p>\r\n','','filtered_html'),('node','biographies','0','109','109','und','0','<p>Eloisa Gomez came from a Midwestern, matriarchal family, and committed her life to social justice and sticking up for feminist and LGBTQ rights.</p>\r\n','','filtered_html'),('node','biographies','0','110','110','und','0','<p dir="ltr">Cecilia has a BA in Teaching Credential from California State University – Fullerton and a Master’s Degree in Policy Studies in Higher Education from the University of California – Riverside. Some doctoral course work was complelted at the University of La Verne.</p>\r\n\r\n<p dir="ltr">After moving to Washington, D.C., in year, Cecilia became a Foreign Service Intern for the U.S. Information Agency and a Program Officer for the Interagency Committee on Mexican-American Affairs. She also worked a Commissioner for the US Commission On Civil Rights, and as a teacher in the Chino School District.</p>\r\n\r\n<p dir="ltr">Married writer and artists José Antonio Burciaga in 1972. In 1974, Cecilia got a job at Stanford University and the couple moved to California. Over 23 years she held various positions at the university, including Associate Dean of Graduate Studies, Associate Provost for Faculty Affairs, and Assistant to the President as Director of the Office of Chicano Affairs. Cecilia fought or policies that would help students of color by increasing their representation on campus. Her position was eliminated in Spring of 1994. There were reported protests from faculty, students, and staff. At the time, she was the highest-ranking Latina officer.</p>\r\n\r\n<p dir="ltr">Cecilia and Antonia enthusiastically supported the Chicano student body and the Chicano/Latino student Center. The couple even moved into Casa Zapata with their two children. This Chicano dormitory was known for its historic murals and housed mostly undergraduate students. It was the site of many Chicano and Latino-related events.</p>\r\n\r\n<p dir="ltr">President Carter appointed Cecilia to Commissioner for the National Advisory on Women from 1977-1980.</p>\r\n\r\n<p dir="ltr"><strong>Leaving Stanford</strong></p>\r\n\r\n<p dir="ltr">Cecilia was named to Clinton’s Presidential Committee on Latinos in Higher Education. <a href="https://ctools.umich.edu/portal/tool/ae17d8bd-ba4e-4ecc-9653-5059b86a0eb7?pageName=%2Fsite%2F98b2c48e-b197-47b5-97e9-7332b6caa0da%2Fmore&amp;action=view&amp;panel=Main&amp;realm=%2Fsite%2F98b2c48e-b197-47b5-97e9-7332b6caa0da"><u>more?</u></a> She is currently the Vice President for Presidential Learning at CSU Monterey Bay, where she began working in July 1994. In 2010 Latina Magazine honored Cecilia as one of 50 women named “Pride of the Century.” She was also awarded with the Eleanor Roosevelt Humanitarian Award.</p>\r\n\r\n<p dir="ltr"><img alt=" " src="https://lh4.googleusercontent.com/kDtzUgE-30PlRtBdz2RaDRFU18DL50i9Lva9PK3D7n0FgR3cOT4qhnxsu8tLFEx-PD2x_qnsghmSpfCDm8b28qMkq71CnTM6dm41yX6nkXUN8GrGovdZQhvgytaRkxmha1PoTP0" title="external link" /><u><a href="http://about.csumb.edu/1999-2000/cecilia-burciaga-honored">http://about.csumb.edu/1999-2000/cecilia-burciaga-honored</a></u></p>\r\n\r\n<div>&nbsp;</div>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','frontpageimages','0','111','111','und','0','<p><a href="http://chicanapormiraza.org/node/13/">http://chicanapormiraza.org/node/13/</a></p>\r\n','','filtered_html'),('node','biographies','0','116','116','und','0','<p><strong>Carmen Tafolla</strong> was born in San Antonio, Texas on July 29, 1951 to a family with a history in San Antonio going back to the early eighteenth century. A resident of the West Side Barrio of the city, Carmen had a happy childhood immersed in Mexican American culture but was also keenly aware of the discrimination and injustice that those in her neighborhood faced. As part of a long history of neglect by the city, her neighborhood had a severe lack of books and literature, and Carmen was extremely eager to get her hands on anything and everything that she could read.</p>\r\n\r\n<p>In her senior year of high school and first years of college at Texas Lutheran, the Chicano Movement opened Carmen’s eyes to the beauty and cultural significance of her Mexican American culture as she experienced Chicano art, poetry, literature and self-empowerment for the first time. After two years at Texas Lutheran, Carmen transferred to Austin College and completed her Bachelor’s of Arts in Education in Spanish and French and her Master’s of Arts in Education in just four years. The same year, 1973, Carmen became the director of the Mexican American Studies center at Texas Lutheran College. She was just 22 years old and worked diligently to determine what a Mexican American Studies center should be and how she could help the few Mexican American students who were enrolled at the college. It was here that she faced further discrimination due to her ethnicity, gender, and youth as a college professor.</p>\r\n\r\n<p>Almost by accident, Carmen first publicly read her poetry in 1975 at the Festival de Flor y Canto 2 in Austin, Texas, and after a positive review, the writing world was opened to her in 1975. In 1977, she participated in the production of “Sonrisas” a bilingual television program for Mexican American children. She had her first tenure track position at California State, Fresno and received her PhD in 1982 in bilingual education at the University of Texas at Austin, using “Sonrisas” as material for her thesis project. Carmen was one of the groundbreaking professors who introduced multicultural considerations into Women’s Studies departments in the mid-1980s. In 1999, Carmen received the Art of Peace Award from St. Mary’s University for her production of works that contribute to peace, justice, and human understanding. Carmen was named the first Poet Laureate of the City of San Antonio in 2012 and became the State Poet Laureate of Texas in 2015 after recovering from breast cancer in 2013.</p>\r\n\r\n<p>In the past several decades, Carmen has published five books of poetry, eight illustrated children’s books, seven television screenplays, one non-fiction volume, and one collection of short stories. She has performed and spoken around the world and is one of the most widely published Latina writers. She is currently an Associate Professor for Transformative Children’s Literature at the University of Texas at San Antonio and is working on her next book of poetry about the “Comadres of Cancer,” who helped her get through her cancer. She currently lives in San Antonio with her husband, daughter, and mother.&nbsp;</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','117','117','und','0','<p>After twelve years of marriage, Torero and Sanchez divorced. In her interview, Sanchez describes the next five years of her life as being some of the hardest she’d ever experienced. However, she says, “Women are always there when you’re miserable and you need somebody – no one else is, but women are.” Chicana women came together to support Sanchez, eventually helping her out of the depression from which she suffered and finding her a position as a mentor for young Chicanas. Now, Sanchez is happily remarried, continuing to write and make art as a way to create positive social change.</p>\r\n','','filtered_html'),('node','biographies','0','128','128','und','0','<p dir="ltr"><span style="line-height:1.6">Currently a social worker in the Cesar Chavez Academy High School in Detroit, Michigan, Maria Anita Guadiana’s involvement with activism and social justice started young with the help of her father, Jose Guadiana. Born in May 8</span><sup>th</sup><span style="line-height:1.6">, 1948, she was the only daughter to Jose Guadiana and Maria Guadiana who had four boys before Guadiana was born. Guadiana cites her father’s organizing with cultural and civic organizations in Detroit and the fact that she grew up in a household with only male siblings as a major influence on her self-identity as an independent and culturally driven individual, regardless of her gender.</span></p>\r\n\r\n<p>Guadiana graduated from high school in 1966, and it was not too long after that she started becoming conscious of social justice issues and social movements. The 1960’s were a time of growing awareness for Guadiana because of figures such as Cesar Chavez and Martin Luther King Jr. who was assassinated in 1968. Her involvement with the 1968 presidential campaign of Eugene McCarthy (who was against the US involvment in Vietman) really opened the doors to her future involvement with the Chicano movement.</p>\r\n\r\n<p>As a result of her connections with Thomas Gonzales and his involvement with the Catholic Workers movement, she attended her first rally for the grape boycott in Detroit, Michigan. She attended the 1969 Brown Barets Convention in Los Angeles, California,&nbsp;with the Detroit Chapter of the Brown Berets, which she had helped organize. Then in&nbsp;1970, she attended the Chicano Youth Conference in Denver, Colorado. As a Chicana from the Midwest, she had always felt as though both herself and her Midwestern peers were considered outcasts in comparison to the organizers in the southwest United States.</p>\r\n\r\n<p>In 1972, Guadiana was in the first cohort of <em>Latino en Marcha</em>, which was an initiative to increase the college attendance of the Latino community in Detroit. Not long after, she was hired as one of the community organizers focusing on Latina/o education issues in Detroit. This project did not pan out, so Guadiana worked many clerical jobs for companies around Detroit, which pushed her to go back to school. With her great background in community activism, she was admitted into the Wayne State School of Social Work and earned her MSW in 1978.</p>\r\n\r\n<p>In Detroit, Guadiana became the director of the senior citizens program at LA SED (Latin Americans for Social and Economic Development). She later forged a career in geriatric social work that took her to various communities around Michigan, but eventually, she found herself working with high school populations in Battle Creek, Michigan. Once she saw that there was an opening at the Cesar Chavez Academy High School in Detroit, she returned to her native city and has been working on behalf of students there ever since.</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','132','132','und','0','<p>Anna NietoGomez was born on March 30, 1946 and was raised on the west side of San Bernadino County, California. NietoGomez recalls that growing up in a segregated community made her aware of racism from an early age. She also recounts growing up in a home where power dynamics between her mother and father were more pragmatic and egalitarian. It was these early insights and environments that would propel NietoGomez into a powerful journey of activism and revolutionary scholarly work.</p>\r\n\r\n<p>The daughter of a World War II veteran and a railroad clerk, NietoGomez began her career in higher education at San Bernadino Community College but she soon matriculated into California State University at Long Beach. While at Long Beach, NietoGomez began to formalize her activism through student organizing in M.E.Ch.A. and UMAS, publishing collectives, one which lead to the newspaper <em>Las Hijas de Cuauhtemoc</em>, counseling through the EOP office at Cal-State Long Beach and other informal mentoring capacities.</p>\r\n\r\n<p>Approaching the turn of the decade in the late 1960’s, NietoGomez eventually began working as an assistant professor in Chicano Studies at Cal-State Northridge (CSUN). NietoGomez pioneered and gave rise to what is arguably the first critical&nbsp;<em>Chicana</em>&nbsp;Studies curriculum. Through her personal research and community organizing experiences, NietoGomez singlehandedly wrote the curriculum for four classes on the Chicana with topics ranging from history, contemporary social issues, global identity, and the family. Nevertheless, in a tenure dispute that escalated into a national call for action in solidarity with Chicana women in higher education, NietoGomez resigned from Northridge in the fall of 1976. The case of NietoGomez’s professorship and tenure demonstrates the pitfalls of the white male dominated Ivory Tower and of machista Chicano ideology, both institutions challenged by NietoGomez and her supporters—students, professors, and Chicanas and Chicanos alike from across the country—who believed she was a victim of racism, sexism, and academic elitism.</p>\r\n\r\n<p>NietoGomez is a true activist/scholar who often bridged the&nbsp;<em>barrio</em>&nbsp;with academia directly. Her commitment to the cause of social justice is nourished by her capacity to endure and remain steadfast in the ideals she crafted over her expansive career as a writer and editor. Beyond her groundbreaking essay and journal&nbsp;<em>La Femenista&nbsp;</em>and <em>Encuentro Feminil,&nbsp;</em>NietoGomez has been producing and researching in the areas of sexuality, reproductive rights, workers rights, welfare rights, higher education, and policy up until the present day.</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','143','143','und','0','<p>Martha Cotera was born in Chihuahua, Mexico in 1938. Cotera describes her upbringing as having a strong dose of progressive politics as a result of her grandparents’ interest in Mexican politics. In 1946, Cotera and her mother immigrated to El Paso, Texas. Cotera was reluctant to move and encountered racist policies in both elementary school and high school while in Texas. Despite these challenges, she describes herself as a “total overachiever” in high school as she was a member of the Writing club, English club, and editor of the school newspaper. Cotera earned her Bachelor of Arts in English with a minor in History at the University of Texas at El Paso in 1962, the same year she became a United States citizen. Cotera cites this period as marking her awakening as a political activist.</p>\r\n\r\n<p>In 1963, Cotera married fellow student, Juan Cotera, and they moved to Austin, Texas so that her husband could continue his education in Architecture at the University of Texas. Although Cotera and her husband encountered extreme racism in Austin, they were determined to stay and help transform the city. In 1964, Cotera was hired as Director of Documents at the Texas State Library in Austin. Later in 1968, she became the director of Southwest Educational Development and was put in charge of 28 libraries across the state of Texas. During this time, both Cotera and her husband were involved in several political and activist organizations including PASSO (Political Association of Spanish Speaking Organizations), and the farmworkers movement. In 1964, Cotera and other educators formed TEAMS (Texans for Educational Advancement for Mexican Americans), a group of educators who garnered support for high school students who participated in student boycotts organized by the Mexican American Youth Organization. In 1968, Cotera and her husband volunteered intermittently in Crystal City, Texas providing curriculum materials and tutoring students who were boycotting the high schools. In 1969, Cotera and her family chose to leave Austin and briefly moved to Mercedes, Texas where she and her husband helped found Jacinto Trevino College. Supported by Antioch College and its University Without Walls program, Jacinto Trevino College was developed as a college for Mexican Americans to prepare teachers for bilingual bicultural education programs. Cotera earned a Master''s Degree in Education from Antioch College in 1971.&nbsp;</p>\r\n\r\n<p>In Crystal City, Cotera headed the Crystal City Memorial Library and was responsible for democratizing the library system. Both Cotera and her husband were intimately involved in the founding and structuring of the Raza Unida Party, a third political party centered on Chicano nationalism. In 1972 Cotera ran for a seat on the State Board of Education on the Raza Unida Party ticket and was instrumental in bringing women into the party. Eventually, Cotera and other women active in the Raza Unida Party began to feel marginalized by the male leadership of the movement, so they established Mujeres de La Raza Unida, a women’s caucus within the party that advocated for the recruitment of women as members. Cotera, along with other women in the Mujeres de La Raza Unida Party, established a Chicana Caucus within the Texas Women’s Political Caucus that drafted several resolutions for the TWPC to consider. In 1974, Cotera (along with Evey Chapa) founded the Chicana Research and Learning Center in Austin, Texas which helped find grant money for research and community projects with an emphasis on women of color. Cotera eventually founded Information Systems Development, an independent research and publishing company which focused on publishing resource materials on and about Chicanos and Chicanas. Cotera self-published her first book in 1976 entitled <em>Diosa y Hembra. Diosa y Hembra </em>was a contribution to the recovery of lost, erased, and hidden histories of Chicana women that&nbsp;generated a tidal wave of interest among Chicana students and within the women’s movement. Cotera then published <em>The Chicana Feminist </em>in 1977, which was a series of essays and speeches reflecting on Cotera’s experiences and observations of the dynamics of feminism within the Chicano/a Movement and of racism and classism within the women’s movement. Since publishing these pivotal works, Cotera has published several more works about Chicanas in politics and the history of Chicanos.</p>\r\n\r\n<p>Cotera worked for nearly three decades as a community liaison for the Benson Latin American Collection at the University of Texas until the position was eliminated due to budget cuts and shifting priorities. She&nbsp;is currently an independent translator and community consultant, and remains active in local politics and community initiatives including the Mexican American Cultural Center, immigrant rights, and Code Pink. She has also been a strong and eloquent advocate against the death penalty in Texas.</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','161','161','und','0','<p>Barbara Carrasco holds a Bachelor of Fine Arts in art from the University of California, Los Angeles and a Master’s of Fine Arts from the California Institute of the Arts. She has been a muralist and artist in various media since her childhood.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Carrasco was born in 1955 in El Paso, Texas, but her family moved to the housing projects for veterans in Culver City (near Los Angeles) within a year of her birth. Her mom was a driving force in creativity and intellectualism through art and literature. This came as a rejection of her mother’s childhood – her mother never felt anchored, which is why reading was so important to her – and that importance was instilled as a value in her children. Sister Mary Anne, Carrasco’s fourth grade teacher, was also formative as far as supporting Carrasco holistically in addition to her passion for art. Carrasco remembers Sister Mary Anne giving the Carrasco family milk in summer school, which was especially influential because Carrasco recalls being poor from a young age. Her father passed away when Carrasco was 12 years old. She was the one to witness his death and had to call 911 to get emergency medical care. This made her feel accountable for carrying on his legacy and wishes. She became interested in college thanks to her father and the Upward Bound program at UCLA (Upward Bound provided college preparatory classes over the summer for her and her sister). The instructors and counselors in the program had a profound effect on her.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In high school, Carrasco was not active in M.E.Ch.A. (Movimiento Estudiantil Chicano de Aztlán). She instead focused on art and journalism. She was an editor of <u>The Oarsman</u>, the Venice High School newspaper, and then become the first female editor of <u>La Gente</u>, the Chicano newspaper at UCLA. While Carrasco was admitted into UCLA, she did not get into the art school. She went to the Dean of the Art School with the dismal numbers on their diversity, arguing that institutionalized racism was to blame for her rejection. She was subsequently admitted to the program. This experience helped Carrasco realize that the word “no” can be turned around if you’re determined enough. She relates this inherent willingness to lead the fight for justice to the fact that Saint Joan of Arc is her patron saint.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In college, Carrasco supported herself through part-time jobs like portraits and commissions for Universal Studios. She continued to develop a variety of artistic techniques, including ballpoint pen and silverpoint, and eventually, in the 1980s, was commissioned to do her very first mural, <em>The History of Los Angeles: A Mexican Perspective, </em>which turned out to be very controversial. The mural was extremely critical of events in American history, such as Japanese internment, which resulted in only parts of the mural ever being displayed at a single point in time. In 1991, Carrasco received her MFA, but wasn’t inspired enough to continue making art, especially with the death of Cesar Chavez in 1993, for whom she created a funeral banner. In 1993, she married Harry Gamboa, Jr., with whom she had been professionally and personally involved for many years. Her daughter, Barbie, was born in 1994 and Carrasco was diagnosed with lymphoma in the following year. She received a bone marrow transplant in 1996 to treat the disease, but found that her hand was never again steady enough to do detailed work. Carrasco has also been active in other areas, such as academia. Carrasco was a UC regent’s professor in 2002-2003 and was a founding member of the Dolores Huerta Foundation, currently serving on the board.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Carrasco focuses on women in her art, which has always been politically oriented. A recent example of this political orientation is her Dolores Huerta piece on the labor and civil rights activist. All of her art has been subject to censorship, not just her aforementioned controversial mural. More recently, she has participated in art collectives like the Galería de la Raza website. And in 2014, Carrasco was recognized as a Los Angeles “Community Champion.”</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','173','173','und','0','<p>Gloria Arellanes was born in East Los Angeles in 1946, but for the majority of her life, she has resided in El Monte, California, living in the same home for over fifty years. Her father was a first generation Mexican-American whose family migrated to the United States from Chihuahua, Mexico, and her mother was a Tongva Native American. In the 1950s and 1960s, El Monte experienced extreme racial tension, and Arellanes witnessed race riots throughout her high school years. She attended college briefly before choosing to drop out, pursuing travel and more life experience. At this young age, she began interacting with a group that would later proclaim themselves the Brown Berets.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>At first she was unsure about joining the radical group, but Arellanes became deeply involved and eventually became the only woman to hold a major leadership position within the organization. As the Minister of Finance and Correspondence for the founding chapter, Arellanes wrote press releases, penned letters, and edited the group’s newspaper, <em>La Causa</em>. Like the Black Panthers, the Brown Berets were considered an extreme, paramilitary group by law enforcement, but their objectives revolved around community betterment and social change. They worked to achieve better education for Chicano youth, gain adequate health services in their communities, end police brutality against minorities, and promote cultural pride. The Brown Berets created El Barrio Free Clinic, and Arellanes was given the task of managing its day-to-day operations. Although she was initially apprehensive about taking the job, El Barrio Free Clinic soon became her passion. Public health facilities and the local hospital knew that she could reach the people they could not. The hospital sent her supplies and picked up lab work from the free clinic regularly. Young people were more comfortable at the clinic, while others were not worried about their legal status affecting their treatment there. Arellanes took pride in the positive impact the clinic had on community members and was thrilled when it sparked interest in the medical field for people who had not considered such careers before.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>During her time with the Brown Berets, Arellanes attended many major Chicano movement events, including the Poor People’s Campaign in Washington, DC, the blowouts, or high school walkouts in Los Angeles, and both Denver Youth Conferences. Arellanes even rented a truck to shuttle high school students to the Denver Youth Conference with her. In the early 1970s, after years of mistreatment and sexism, all female members separated from the Brown Berets. After her departure from the Brown Berets, Arellanes organized Las Adelitas de Aztlán, a women’s group, and started another free clinic, La Clinica del Barrio. Her involvement in the Chicano Moratorium, a large anti-Vietnam War and civil rights demonstration, cannot go unnoted either. Arellanes was on stage when the violence broke out. She was tear gassed, and although she recovered physically, she was emotionally scarred for many years by what she witnessed that day.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Since the movement years, Arellanes has reconnected with her Native American heritage and is now an elder of the Tongva tribe. She served as a secretary on the Tribal Council and is part of an Indigenous Grandmothers group. She raised two sons as a single mother and now has a grandson.</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','196','196','und','0','<p>Alicia Escalante was born in El Paso Texas, in 1933 to what she describes as a traditional family. She was the second oldest of seven children, and she shared an intense bond with her mother. After 15 years of marriage, Escalante’s mother decided to divorce her father due to his infidelity, alcoholism and abuse. At the divorce court proceedings, her father was granted custody of all seven children, because of &nbsp;her mother’s lack of employment and housing. After the divorce, Escalante’s mother moved to Los Angeles to live with her sister and find work in hopes that she might be able to regain custody of her children. Devastated to be separated from her mother, and miserable with “the oppressive situation” of living with her father’s extended family (who frequently blamed her mother for the divorce), Alicia Escalante vowed to be reunited with her mother at any cost., At the age of nine, Escalante jumped into an open freight car of the train that ran behind her house. She was determined to make it to California by any means necessary.After the police discovered her, her father allowed her to continue on her journey to California, where her legacy would begin.</p>\r\n\r\n<p>As Alicia entered adulthood and began to forge a life for herself, it became very clear that there were many inequalities that surrounded her. &nbsp;A single mother of five, she was swallowed by poverty and thus began to recognize the Welfare system as punitive and oppressive. Alicia felt that the women forced to seek services were never treated with any dignity or respect. This would drive her to become involved with the Chicano Movement and eventually to create the East LA Welfare Rights Organization in 1967. &nbsp;She was able to get the organization started with the assistance of her family practitioner, Doctor Carlo. He set her up with an office and phone where she was able to begin mobilizing the community on welfare rights issues surrounding medical and services cuts. &nbsp;Alicia was concerned about the mistreatment of women, specifically Blacks and Latinas, who found themselves on welfare “through no fault of their own.”</p>\r\n\r\n<p>As part of the Welfare Rights Movement and Chicano Movement she became very close with leaders like Corky Gonzalez and Gloria Arellanes. After political and legal persecution as a result of her activism, Escalante spent some time in Denver teaching Spanish and Welfare rights at Corky Gonzales’ Escuela Tlatelolco. She was also involved with protesting police brutality, the Vietnam War and researching world hunger.</p>\r\n\r\n<p>Escalante’s Chicana Welfare Rights Organization provided community workshops on welfare policies and rights, translated welfare forms for Spanish speaking families, aided people in applying for aid and grievances, and even opened a café to help feed the community while training welfare women for work. She also worked to create a bilingual newspaper through her organization, La Causa De Los Pobres. Alicia began to realize her writing could be used to mobilize and empower people to enact change. Although her newspaper was short lived, she wrote many articles for various news outlets including Encuentro Femenil and La Raza Newspaper.</p>\r\n\r\n<p>Alicia worked to transform Welfare policies on a state and national level, even participating in the Poor People’s Campaign march on Washington. She was also involved in policy change around the sterilization of women of color and in shaping early Chicana feminist thought during the Chicana Movement. &nbsp;After moving to Sacramento California, Alicia continued to advocate for underrepresented women and youth as a Social Worker.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','207','207','und','0','<p>Yolanda Alaniz was born in Brownsville, Texas and raised in Sunnyside, Washington in the Yakima Valley where she and her family worked as farmworkers. Tired of earning very low wages, her mother organized rallies along side other farm workers and most notably union leader Caesar Chavez to protest the unjust conditions and unfair wages many workers faced.</p>\r\n\r\n<p>In 1969, thanks to the guidance of diversity recruiters and her mother’s ardent motivation to have her daughter attend college, she began attending The University of Washington. During her undergraduate years she became an influential member in Chicana/o rights organizations like MEChA, Brown Berets, and Las Chicanas.</p>\r\n\r\n<p>In 1975 she was one of the leaders in the student, staff and faculty strike protesting the firing of two Chicano administrators and the secretary of Chicana/o Studies from the University of Washington. The same year she joined campus Radical Women, a socialist feminist national organization. She also worked as a reporter for the campus daily. She frequently wrote articles about women and people of color issues. Yolanda Alaniz credits higher education for opening her eyes to political injustices and sparking her interest in politics and writing.</p>\r\n\r\n<p>Yolanda Alaniz graduated with a BA in journalism and became active in City of Seattle politics through the Hispanic Association of City Employees and the Seattle Women’s Commission. Yolanda Alaniz made history when she ran for City Council in 1991 as the first Latina feminist socialist and city employee.</p>\r\n\r\n<p>In 1995 she moved to Los Angeles and continued her political activism with Radical Women and the Freedom Socialist Party. She focused on women, lesbian and gay issues for workers and immigrant rights. Yolanda continued her education at the University of California and earned a Masters of Library and Information Science. Today, she works as an archivist and writer. She has been apart of works such as Nellie Wong’s Voices of Color and iViva la Raza!. She also serves on the Editorial Board for the Freedom Socialist newspaper where she coordinates the Voices of Color column</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','224','224','und','0','<p><span style="line-height:1.6">Ana Luisa Cardona was born on June 11, 1950 in the Bronx, NY. Her Puerto Rican parents raised Cardona with her brother in a traditionally Jewish neighborhood that slowly evolved to a multi-ethnic minority space. In elementary school, Cardona was placed in a special education class and tracked into lower ability-level classes because she was shy, but she soon grew out of her shyness thanks to dance classes. Her mother ensured that Cardona’s first language was English and that Cardona had access to equitable education by enrolling her in parochial school.</span></p>\r\n\r\n<p>In her all-female high school, Cardona pursued the academic track and, while she was successful academically, she was also frustrated by the fact that the arts were treated as “extracurricular.” In spite of her great high school experience, Cardona realized there were many different walks of life outside of the Bronx. In college, Cardona commuted to classes at Marymount Manhattan College, extending the time in what she calls her “gilded cage.” During her first trip abroad, to study in Spain during the Francisco Franco regime, Cardona joined a politically motivated theatre group, which was her first taste of activism and initiated her political awakening. Following her trip abroad, and her graduation with a BA in Studio Art and Art History from Marymount Manhattan College, Cardona left New York for the University of Michigan, where she pursued graduate studies in Art History.</p>\r\n\r\n<p>At Michigan, Cardona soon found the Chicano Advocates Office and met activists Jesse Gonzalez and Julio Perazza. Together, they began the Raza Art and Media Collective. Through the Raza Art and Media Collective, Cardona recruited many Californian Chicanos, Tejanos, New Mexicans, and Puerto Ricans. Cardona enjoyed working with Chicano artists and the vibrant Chicano art scene, and eventually she became more engaged by the art she was learning about outside of her Master’s program than she was with the more traditional art history she was learning in her classes. Nevertheless, she still managed to earn Master’s degrees in History of Art and Instructional Technology from the University of Michigan. After completing her course of study, Cardona traveled to Puerto Rico with Julio Perazza to photograph subjects and record oral histories for a project called “Los Viejitos.” Cardona was also essential in the activities of Casa de Unidad in Detroit in the late 1970s.</p>\r\n\r\n<p>In 1977, Cardona received a fellowship to work at the National Endowment for the Arts in D.C where she provided administrative support to the Hispanic task force. While in Washington, Cardona became pregnant with her son, Simón, and her partner, Julio Perazza, moved from Michigan to D.C. to work at the Library of Congress. Cardona returned to Puerto Rico in 1980 for a trip with her family and conducted an oral history of Jack Delano, who was the head of the Division of Community Education in the 1950s. When she returned to Michigan, she found a position in the College of Education’s Office of Minority Affairs at the University of Michigan and Jack Delano continued to be a solid artist-mentor for Cardona. Eventually, Cardona took a position at the Michigan Department of Education, where she worked from 1987 to 2011. She is a longstanding activist for equity and art in education and has devoted 23 years in multiple leadership positions. She continues to provide leadership in arts education at the state and national levels.</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','240','240','und','0','<p dir="ltr">Juana Maria Gonzales’s involvement with the Chicana movement started in her hometown of Mercedes, Texas. Born in 1948, Gonzales was the second oldest of eleven children raised in a strict Catholic family in south Texas. From an early age, her family dynamics made her aware of gender disparities and how her identity as a woman changed the way she moved in the world. This realization propelled Gonzales to become interested in women’s issues such as the concept of autonomy and rape culture.</p>\r\n\r\n<p>Gonzales moved to Michigan in her twenties to help look after two of her siblings who were attending college at Western Michigan University in Kalamazoo, Michigan. Prior to moving to Michigan permanently, Juana and a few of her siblings lived in different parts of Michigan and Wisconsin working as migrant workers. In Kalamazoo, Juana became involved with many groups, serving as a member of a Chicano Advisory Board to Kalamazoo Public Schools and working at Kalamazoo Planned Parenthood and Kalamazoo Daycare Center. She also recalls organizing an informal group of Chicanas who met frequently to discuss the gendered contradictions they faced within the Chicano movement. It was in Western Michigan that she met her husband, Jesse Gonzales, who was part of a rising student leadership movement.</p>\r\n\r\n<p dir="ltr">After her husband was admitted to a Master''s Program at the University of Texas, they moved to Ann Arbor, where they joined a growing group of Latino activists (among them Julio Perazza and Ana Cardona) participating in a number of cultural and political organizations and activities, including the production of a recruitment film aimed at Latina/os. Gonzales attended the University of Michigan briefly and then finished her degree at Michigan State University, where she received a Bachelor of Arts in Family and Child Science. Gonzales participated in several student groups during her time at both universities, including the Chicano Student Movement Group, the Women’s Advisory Committee, Chicano Students for Progressive Action, Trabajadores Por La Raza, and Mujeres Unidas de Michigan. She was also active in the Chicano student movement at MSU, and served on several campus-wide committees including the MSU Presidential Search Committee in 1978 (M. Cecil Mackey).</p>\r\n\r\n<p dir="ltr">In 1979, Gonzales began teaching early elementary students at Red Cedar School in East Lansing, Michigan. While teaching, Gonzales provided educational opportunities to migrant children, served as a migrant daycare teacher, and taught in the migrant program at Lansing Community College. She was awarded a Crystal Apple Award in 2003 from the College of Education at Michigan State University honoring her service to education and her commitment to teaching. Currently, Gonzales is retired and living in East Lansing, Michigan with her husband, Jesse Gonzales.</p>\r\n\r\n<div><a href="https://www.youtube.com/watch?v=XO4zEUixnBc">https://www.youtube.com/watch?v=XO4zEUixnBc</a></div>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','251','251','und','0','<p>Angela Reyes was born on October 2,1954 and has lived and served in the community of Southwest Detroit ever since. Throughout her time from elementary to high school, Angela recounts coming face-to-face with prejudicial attitudes from classmates and teachers, experiences that forever marked her own developing, personal identity as a Mexican woman with indigenous roots.</p>\r\n\r\n<p>With a natural inclination towards community building and healing, Angela initially began formalizing her multifaceted approach to community care through the Chicano Boricua Studies (CBS) program at Wayne State University. As a member of the pioneering class of CBS, Reyes attributes her time in the program and the tandem student group, El Colectivo, as the space that taught her that the insight of her ideas—ideas of racial justice and community equity—were not only valid, but also potentially transformative.</p>\r\n\r\n<p>Angela drew on her deep rooted sense of belonging to Southwest Detroit as well as a big picture view of community relations in her work with at-risk Latinx populations through Latino Outreach, a non-profit agency now known as Latino Family Services (LFS) in the 1970s. After over a decade of work at LFS, Angela, built on her experience with the nuances of non-profit work in Southwest Detroit to found the Detroit Hispanic Development Cooperation (DHDC) in 1998.</p>\r\n\r\n<p>While its early years were humble, the DHDC has evolved from a small collective of people working out Angela’s living room to a historic, award winning resource center whose mission has remained centered around the lived experiences of at-risk Latinx youth.</p>\r\n\r\n<p>Today, DHDC is still directed by the tireless and brilliant efforts of Reyes and her family. Angela’s now adult children, along with other “graduates” of DHDC services, remain faithful to the work of the organization and have carved out roles for themselves working alongside Angela’s direction to continue their mission—a truly inspiring “full circle” of community justice and accountability. Since its inception, Angela Reyes and DHDC have continued to expand their resources for Latinxs across Southwest Detroit; DHDC offers after school and summer programs for the youth, English as a Second Language courses, GED Classes, HIV and AIDS prevention and outreach programs, FIRST robotics programs, scholarship opportunities, housing counseling, parenting classes, tattoo removal services, community organizing liaisons, gang retirement programs, and much more.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For more information about DHDC,&nbsp;<a href="http://www.dhdc1.org/" style="line-height: 20.8px;">click here</a>&nbsp;to visit their official website.</p>\r\n','','filtered_html');
INSERT INTO `field_revision_body` VALUES ('node','page','0','258','258','und','0','<p><iframe frameborder="0" height="650" src="//cdn.knightlab.com/libs/timeline3/latest/embed/index.html?source=1hrXc_4ndUt34OaluPQC6cv79mjG8E1FMSyRhAEN1juA&amp;font=Default&amp;lang=en&amp;initial_zoom=2&amp;height=650" width="100%"></iframe></p>\r\n\r\n\r\n<iframe src=''https://cdn.knightlab.com/libs/timeline3/latest/embed/index.html?source=1TvgBzpb-keMo-fITEJEOz6XRDMxXOhy2TpNfbpK58v0&font=Default&lang=en&initial_zoom=2&height=650'' width=''100%'' height=''650'' frameborder=''0''></iframe>','','php_code'),('node','page','0','259','259','und','0','<p><iframe frameborder="0" height="650" src="//cdn.knightlab.com/libs/timeline3/latest/embed/index.html?source=1aKKwTU6nYURX6Ll2z5Us2XAhEmx1ZmxjMBbVZoF1mHQ&amp;font=Default&amp;lang=en&amp;initial_zoom=2&amp;height=650" width="100%"></iframe></p>\r\n\r\n\r\n<iframe src=''https://cdn.knightlab.com/libs/timeline3/latest/embed/index.html?source=1TvgBzpb-keMo-fITEJEOz6XRDMxXOhy2TpNfbpK58v0&font=Default&lang=en&initial_zoom=2&height=650'' width=''100%'' height=''650'' frameborder=''0''></iframe>','','php_code'),('node','page','0','260','260','und','0','<p><iframe frameborder="0" height="650" src="//cdn.knightlab.com/libs/timeline3/latest/embed/index.html?source=1Ljsh72ulBQFsXnkLbSlCPciFFYfzF5AmMqwAJLyA7E0&amp;font=Default&amp;lang=en&amp;initial_zoom=2&amp;height=650" width="100%"></iframe></p>\r\n\r\n\r\n<iframe src=''https://cdn.knightlab.com/libs/timeline3/latest/embed/index.html?source=1TvgBzpb-keMo-fITEJEOz6XRDMxXOhy2TpNfbpK58v0&font=Default&lang=en&initial_zoom=2&height=650'' width=''100%'' height=''650'' frameborder=''0''></iframe>','','php_code'),('node','page','0','261','261','und','0','<p><iframe frameborder="0" height="650" src="//cdn.knightlab.com/libs/timeline3/latest/embed/index.html?source=1fzvsW3W60qFxbX_xH7YEM70dlRrHKtdUIY0wfFbgZsw&amp;font=Default&amp;lang=en&amp;initial_zoom=2&amp;height=650" width="100%"></iframe></p>\r\n\r\n\r\n<iframe src=''https://cdn.knightlab.com/libs/timeline3/latest/embed/index.html?source=1TvgBzpb-keMo-fITEJEOz6XRDMxXOhy2TpNfbpK58v0&font=Default&lang=en&initial_zoom=2&height=650'' width=''100%'' height=''650'' frameborder=''0''></iframe>','','php_code');
INSERT INTO `field_revision_body` VALUES ('node','page','0','262','262','und','0','<p>CPMR relies on the brilliance and motivation of many dedicated undergraduate students to preserve, identify, and create new content related to our holdings. These biographies reflect over 5 years'' work by students whom have participated via classes, independent studies, and research seminars. Students are entirely responsible for the creation of these biographies and each biography is an ever-expanding, previously unavailable record of knowledge. <em>Please contact us at chicanapormiraza@gmail.com with any concerns or updates to the information displayed here.</em></p>\r\n','','filtered_html'),('node','historias','0','263','263','und','0','<p><span style="font-size:16px">By Marie Dillivan<br />\r\n&nbsp;</span></p>\r\n\r\n<p><span style="font-size:16px">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The Raza Art and Media Collective was founded at the University of Michigan in Ann Arbor in 1974. The group’s founders were University of Michigan students with backgrounds in art, art history, community education, film, photograph, and journalism <a href="#Olga-Herrera">[1]</a>. They included Ana Luisa Cardona, Michael J. Garcia, Jesse Gonzales, George Vargas, Julio Perazza, S. Zaneta Kosiba Vargas, and Zaragosa Vargas <a href="#raza-art">[2]</a>. Ana Cardona described the organization as a “not for profit organization devoted to the creation and documentation of the arts and media by and for the Spanish-speaking and non-Spanish-speaking communities”[3]. While the members were mostly Chicana/o students at the University of Michigan, Cardona and Perazza were both Puerto Rican, reflecting the diversity of the Latina/o demographics of the Midwest. The Collective organized themselves as a student organization at the University of Michigan, which included benefits such as office space and funding <a href="#ana-oralhistory">[4]</a>. They also secured funding through community fundraising activities and grants from the Michigan Council for the Arts and, later, the Literature Program of the National Endowment for the Arts [5].</span></p>\r\n\r\n<div class="media_embed" height="315px" width="560px"><iframe allowfullscreen="" frameborder="0" height="315px" src="https://www.youtube.com/embed/yp07lS_L13E" width="560px"></iframe></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:16px">The Raza Art and Media Collective came into existence during a particularly tumultuous political and social moment on the campus of the University of Michigan and in the United States as a whole. This period—which witnessed the radicalization of the Civil Rights Movement, the Feminist Movement, the Chicano Movement, the Anti-War Movement, and the Student Movement—“brought national issues of poverty, urban crisis, repression, discrimination, racial and ethnic tensions” among other social issues to the attention of the general population [6]. In response to this changing political and social climate on the University’s campus and in the nation, the Raza Art and Media Collective was formed with the intent to combat stereotypes about Latina/os and provide a platform for art that had been previously less widely visible.&nbsp;</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<span style="font-size:16px">The RAM Collective responded to the increased activity of Latino and Latin American artists in the Midwest and the social and political issues of the Chicano movement. The Collective’s connections with other art collectives around the United States have been documented in an essay by Olga U. Herrera, which discusses the Collective’s connections with Con Safos and Asco. These connections provided inspiration for their art and helped them to figure out how to combat stereotypes of Chicano and Latino art in general. Their goal in creating a platform and resource for “Raza art” was to provide an inclusive space for Latina/o artists of all backgrounds, for both Spanish-speaking and non-Spanish-speaking artists and audiences, and for Latina/os in Michigan specifically. Central to this objective was the Raza Art and Media Collective Journal, which sought to give a voice and a platform to Chicano and Latino artists in the Midwest. Ana Cardona indicated that the group immediately went into “publication mode” once they organized because they felt that there was a crucial need for material on Chicano and Latino art [7]. The RAM Collective gathered outside submissions along with the work of the members to create a total of four issues of the RAM Collective Journal from 1976-1977.&nbsp;</span></p>\r\n\r\n<p><span style="font-size:16px">Despite its relatively short run, the impact and influence of the journal was far-reaching because it was a critical platform for Latina/o artists in the Midwest during a period when Latina/o art itself was understudied and when the contributions of the Midwest to Latina/o art and literature were fairly unacknowledged. The Raza Art and Media Collective received support for its Journal from universities and departments around the country, including subscription requests and letters of support from UCLA, Indiana University, and Stanford University throughout 1976. A sample of the letters of support for the RAMC Journal from around the country shows the importance of the Journal at the time for Hispanic/Chicano/Latino Studies departments as they were provided with a resource to help introduce their students to Latino art. They also show the wide reach that the Journal had beyond its own community and university, allowing both the artists and the subject of Latina/o art to gain national recognition.</span></p>\r\n\r\n<p class="rtecenter"><span style="font-size:16px"><img alt="" src="/sites/default/files/Screen%20Shot%202016-06-30%20at%208.58.40%20PM.png" style="height:388px; width:500px" /></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:16px">Unfortunately, despite widespread support, the last edition of the Raza Art and Media Collective Journal was in 1977. Members of the RAM Collective eventually moved into other phases of their lives, as university students do, and on to other areas of Latina/o arts advocacy in Michigan and elsewhere. The history and impact of the Raza Art and Media Collective and its Journal has been only partially documented. Karen Mary Davalos provides an accurate summary of how the Collective established themselves as part of the national fabric of the Chicano arts movement while remaining open regarding the aesthetic, conceptual and ideological boundaries of “Raza art.” She notes: &nbsp;“The rejection of a ‘strict Chicano or Latino/Raza aesthetic’ allowed these Midwestern groups to support the Chicano nationalist project of self-determination and empowerment and position themselves as an ‘integral part of Aztlán’ while remaining inclusive of artists whose identities were not Chicano”[8]. With only four issues of the journal, the Collective was able to help to fill a void and make themselves and their art visible around the country while promoting their efforts to bring more visbility, &nbsp;and inclusivity, to Latino art. The fact that the group achieved national recognition and success in such a short period of time and with such a small amount of resources is indicative of the contemporary need for material on the subject of Chicano and Latino art. &nbsp;</span><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14px"><span style="font-family:tahoma,geneva,sans-serif"><a id="Olga-Herrera" name="Olga-Herrera"></a>[1] <a href="http://icaadocs.mfah.org/icaadocs/Portals/0/WorkingPapers/No1/Olga%20U.%20Herrera.pdf">Olga U. Herrera "Raza Art and Media Collective: A Latino Art Group in the Midwestern United States." Institute for Latino Studies, University of Notre Dame: 32.</a><br />\r\n<br />\r\n<a href="http://chicanapormiraza.org/record/raza-art-and-media-collective-journal-volume-1-number-1" id="raza-art" name="raza-art">[2]The Raza Art and Media Collective Journal I, no. 1 (1976): 1.</a><br />\r\n<br />\r\n[3] “Ana Cardona CV.” Ana Cardona Archive, Chicana Por Mi Raza, 1979. Medici.<br />\r\n<br />\r\n<a id="ana-oralhistory" name="ana-oralhistory"></a>[4] “Ana Cardona Oral History.” Ana Cardona Archive, Chicana Por Mi Raza, 2015. Medici.<br />\r\n<br />\r\n[5] “Ana Cardona CV”, Chicana Por Mi Raza</span></span></p>\r\n\r\n<p><span style="font-size:14px"><span style="font-family:tahoma,geneva,sans-serif">[6] Herrera, “Raza Art and Media Collective,” 31.</span></span></p>\r\n\r\n<p><span style="font-size:14px"><span style="font-family:tahoma,geneva,sans-serif">[7] Herrera, “Raza Art and Media Collective,” 31.<br />\r\n<br />\r\n[8] Karen Mary Davalos, Exhibiting Mestizaje: Mexican (American) Museums in the Disapora (Albuquerque: University of New Mexico Press, 2000), 78.</span></span></p>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','biographies','0','266','266','und','0','<p dir="ltr">Nancy Alicia De Los Santos Reza was born and raised in Chicago, Illinois. Her parents were born in Texas and migrated to the big city after World War II. Nancy’s father, Nicolas, served in the Navy. Her mother, Micaela, was a stay-at-home mother and housewife, raising six children. Their own negative experience with speaking Spanish in Texas schools, led to the decision for their children to speak English only.</p>\r\n\r\n<p dir="ltr">From a young age, Nancy experienced the segregation and racial tension that characterized Chicago in the 1970s. As a young Mexican-American girl, she grew up surrounded by a loving and large Mexican American family; but outside of the family, being “Mexican” was not considered an asset.</p>\r\n\r\n<p dir="ltr">Nancy struggled with finding her identity among her black and white peers at the &nbsp;public and parochial schools she attended. She did find a sense of belonging among the Spanish Chantels, a girl gang and social club as a young girl. Later she would discover a similar sense of community with the Pilsen community organization Mujeres Latinas en Acción.</p>\r\n\r\n<p dir="ltr">Despite being a bright high school student, no one ever encouraged Nancy to consider attending college. Instead, she–like other young Latina students–was steered to Jones Commercial High School: a secretarial school that provided half day office jobs for seniors in high school and taught them office skills and personal grooming. After graduation Nancy began a secretarial job at Northwestern Memorial Hospital. While there, she met a coworker whose family had sent him from Bogota, Colombia to attend college in Chicago, and it was he who convinced her to attend college. She began studying at Chicago City College, transferred to Northeastern Illinois University, and eventually finished her bachelor’s degree at the University of Texas at Austin. She later completed her Masters in Communications at the University of Michigan at Ann Arbor.</p>\r\n\r\n<p dir="ltr">It was at Northeastern University that Nancy’s interest in Chicano and Chicana activism and identity peaked. She became co-editor with fellow student José Gaspar of the Chicano student newspaper, “Contra la pared.” She also met a few influential professors, sociologists Samuel Betances and Alberto Mata, who shaped her thinking and encouraged her to pursue an independent study on Latinos in television in Los Angeles. During this period, Nancy traveled to the west coast with Gaspar, where they audited classes for a semester at Cal State Northridge and were immersed in this birthplace of Chicano studies, studying with famed Rudy Acuña and Raul Ruiz. By the time she transferred to the University of Texas, Nancy knew she wanted to study media.</p>\r\n\r\n<p dir="ltr">During the mid-1970s, Nancy’s involvement with the advocacy group “Mujeres Latinas en Acción” became they very foundation of her social activism. This group changed a lot for Nancy in terms of her identity and clarity as a Latina and a Chicana. In 1975 she attended the International Women’s Year Conference in Mexico City with the group, which gave her a new perspective on her heritage, her gender, and the world. The influence of Mujeres Latinas marked a key step for Nancy on her long journey towards embracing her Mexican heritage and supporting feminist ideology.</p>\r\n\r\n<p dir="ltr">After graduating from the University of Texas’s Radio, Television, and Film Department, Nancy completed her Master’s degree in Communications at the University of Michigan, and then moved back to her hometown to work for WTTW11, the public TV channel in Chicago. She worked her way up to become the producer of &nbsp;“At the Movies” with film critics Roger Ebert and Gene Siskel. Nancy is now a successful and well-respected writer, producer, and director. She’s been involved with numerous projects including her own celebrated documentary “The Bronze Screen: 100 Years of the Latino Image in Hollywood Cinema”, a historical look at Latinos in Hollywood.</p>\r\n\r\n<p>Nancy continues to write, produce, and direct in L.A., and to live her life mission to create realistic images of Latinos and Latinas in the media.</p>\r\n','','filtered_html');
