INSERT INTO `field_revision_field_description` VALUES ('node','record','0','201','201','und','0','Newspaper article about Alicia Escalante leading a protest against insensitive County Welfare Director.',null),('node','record','0','202','202','und','0','The inside of of a brochure for the poor peoples campaign, a campaign involving a march to Washington, that Alicia attended, and non-violent demonstrations to bring attention to poverty and the rights of the poor.',null),('node','record','0','203','203','und','0','An edition of La Causa de los Pobres, a newspaper dedicated to all Chicano Welfare Rights Oranizations and created to provide readers information about welfare rights, in which an article by Ruben Salazar called, "Growing Communications Welfare Gap," is featured. Alicia Escalante is featured in the article as the Chairman of the East Los Angeles Welfare Rights Organization.',null),('node','record','0','204','204','und','0','Alicia Escalante tells her story of being a single mother on welfare and the humiliation and inequality she experienced. She writes about how she joined protests and got involved with activism.',null),('node','record','0','205','205','und','0','Photo of the Chicana Welfare Rights Organization float in the Denver Crusade for Justice, a Chicano civil rights organization, parade in front of the Denver post office.',null),('node','record','0','206','206','und','0','Alicia Escalante''s personal testimony about her round-the-world tour in order to explore hunger both abroad and in the United States.',null),('node','record','0','208','208','und','0','A document calling the boycott of a women bar to protest their racist policies and actions ',null),('node','record','0','209','209','und','0','A vibrant flyer advocating that consumers don''t buy lettuce and grapes not picked by unionized workers',null),('node','record','0','210','210','und','0','Yolanda Alaniz is a columnist for the Voices of Color editorial, here she is speaking on her experiences and political ideology ',null),('node','record','0','211','211','und','0','Yolanda Alaniz was one of the leaders in the student, staff and faculty strike protesting the firing of two Chicano administrators and the secretary of Chicana/o Studies from the University of Washington. This is their resignation in solidarity. ',null);
INSERT INTO `field_revision_field_description` VALUES ('node','record','0','212','212','und','0','Vibrant picture of Yolanda Alaniz (in purple) dining with friends ',null),('node','record','0','213','213','und','0','First page of a 4 page length document in which Yolanda expresses her political views and why she is a self proclaimed feminist socialist. ',null),('node','record','0','214','214','und','0','A letter from the U.S Senate congratulating Yolanda Alaniz for recieving a grant to attend college ',null),('node','record','0','215','215','und','0','A second letter from the U.S Senate congratulating Yolanda Alaniz for recieving a grant to attend college ',null),('node','record','0','216','216','und','0','A letter from Shirley Skellenger, then president of the Seattle Women''s commission expressing regret on receiving news of Yolanda''s resignation due to ill health ',null),('node','record','0','217','217','und','0','This photo shows Martha Cotera and her husband Juan packing for Crystal City, Texas in 1970. ',null),('node','record','0','218','218','und','0','This video shows Martha Cotera at the Code Pink Rally in 2013. ',null),('node','record','0','219','219','und','0','Photograph of the Raza Unida Party on the cover of La Lomita in April 1972.',null),('node','record','0','220','220','und','0','Photograph shows Martha Cotera at the 1977 International Women''s Year National Women''s Conference in Houston, Texas. Taken from Wiener''s Book.',null),('node','record','0','221','221','und','0','Photocopy of a picture of Martha Cotera.',null),('node','record','0','222','222','und','0','Photograph shows Martha Cotera at the 1977 International Women''s Year National Women''s Conference in Houston, Texas. ',null),('node','record','0','225','225','und','0','This is the cover of the binder containing documents from the "Los Viejitos" project and The Raza Art and Media Collective. The binder also includes some of Ana Cardona''s personal documents and corespondance.',null),('node','record','0','226','226','und','0','Scan of "Razartes" March 1978, Schedule on inside of trifold pamphlet unfolded',null);
INSERT INTO `field_revision_field_description` VALUES ('node','record','0','227','227','und','0','Letter of Recommendation for Ana Luisa Cardona in support of her candidacy for the work experience internship program sponsored by the national endowment for the arts',null),('node','record','0','228','228','und','0','Welcome letter to the National Endowement''s Work Experience Internship Program addressed to Ana explaining next steps to her intership with NEA',null),('node','record','0','229','229','und','0','Subscription Request from UCLA to Raza Art and Media Collective Journal',null),('node','record','0','230','230','und','0','Letter naming Ana Cardona as a Center for Education of Women (CEW) scholar.',null),('node','record','0','231','231','und','0','The second version in the binder of Ana Luisa Cardona''s CV.',null),('node','record','0','232','232','und','0','Contains the second edition of the Raza Art and Media Collective Journal. Pages 1-6.',null),('node','record','0','233','233','und','0','This page contains photographs from Ana''s trip to Puerto Rico to produce "Los Viejitos"',null),('node','record','0','234','234','und','0','This page contains photographs from Ana''s trip to Puerto Rico to produce "Los Viejitos"',null),('node','record','0','235','235','und','0','Letter thanking Ana Cardona for participation in "Semana Puertorriquena" at Michigan State University from the planning committee',null),('node','record','0','236','236','und','0','Letter Thanking Ana Cardona for participation in conference on Michigan Education and the Latino',null),('node','record','0','237','237','und','0','Juana and Jesse Gonzales portrait taken in 1972. ',null),('node','record','0','238','238','und','0','Chicana Group at Western Michigan University having a party for Emily Cantu, Juana is in back row. ',null),('node','record','0','239','239','und','0','Performance of the Ballet Folklorico at the University of Michigan, 1974. Juana in the background, dancing.',null),('node','record','0','241','241','und','0','Family photo appearing in newspaper article of 50th wedding anniversary of Juana''s parents.',null);
INSERT INTO `field_revision_field_description` VALUES ('node','record','0','242','242','und','0','Picture of eight out of the eleven De Los Santos children. Juana is the second from the right.',null),('node','record','0','243','243','und','0','Letter from Jesse Gonzales to Juana Gonzales in 1974. ',null),('node','record','0','244','244','und','0','Image of Chicana meeting, December 1974. ',null),('node','record','0','245','245','und','0','Portrait from Juana and Jesse Gonzales''s Wedding in 1974.',null),('node','record','0','246','246','und','0','Portrait of Juana Gonzales teaching.',null),('node','record','0','247','247','und','0','Juana Gonzales''s Muniz ''74 sewing kit.',null),('node','record','0','248','248','und','0','13 buttons from Juana Gonzales''s collection. Includes: F.L.O.C. - Hasta La Victoria, I''m Fasting-to protest the use of toxic pesticides on California Table Grapes, No Violencia Es Nuestra Fuerza, Michigan and I Support-1927-1993-Cesar Chavez, Unidos Ganaremos, The Wrath of Grapes, Viva La Huelga, Boycott Non-UFW Grapes, Lucha por Justicia sin Violencia-Cesar Chavez-La Foundacion de Chavez, Viva La Mujer, Boycott Grapes-Huelga, Don''t Buy Red Coach Lettuce.',null),('node','record','0','249','249','und','0','Voting Credential Card for Juana Gonzales from the NEA (National Education Association) Women''s Caucus. ',null),('node','record','0','250','250','und','0','Cover of Crystal Apple Awards program from 2003 when Juana Gonzales received award. ',null),('node','record','0','252','252','und','0','Angela Reyes was presented this award for her accomplishments and devotion to the youth of Southwest Detroit by MANA De Michigan.',null),('node','record','0','253','253','und','0','Angela Reyes carrying her infant daughter Anita Zavala.',null),('node','record','0','254','254','und','0','Waynes State University Center for Chicano-Boricua Studies presented Angela Reyes with their Community Service award in recognition of her work with empowering the Hispanic youth of Southwest Detroit to pursue higher education.',null),('node','record','0','255','255','und','0','Angela Reyes was awarded the Community Service Award from the Detroit City Board of Education for her commitment to gang violence prevention.',null);
INSERT INTO `field_revision_field_description` VALUES ('node','record','0','256','256','und','0','Angela Reyes received this award for her contributions to the Matrix Theater Company, a community organization in Southwest Detroit that uses Theater to foster community and social justice for the youth.',null),('node','record','0','257','257','und','0','The National Council of La Raza presented Detroit Hispanic Development Corporation-a non profit organization founded by Angela Reyes,CEO-with a certificate of affiliation for the organization''s commitment to the empowerment of the Hispanic community of Southwest Detroit.',null),('node','record','0','264','264','und','0','Ana Cardona discusses her experience at University of Michigan meeting up and participating in organizations with Chicanos including the Raza Art and Media Collective. ',null),('node','record','0','265','265','und','0','Contains the first edition of the Raza Art and Media Collective Journal, front page and page 2.',null),('node','record','0','271','271','und','0','Inside cover of deluxe blue instamatic photo album',null),('node','record','0','272','272','und','0','Graffiti on empty building decrying landowners',null),('node','record','0','273','273','und','0','Image of farmworker smiling and standing next to UFS flags atop a pile of wood in a field somewhere in Texas, 1977 - Peregrinacion from San Juan to Austin?',null),('node','record','0','274','274','und','0','Photo of pulqueria shows that there are seperate entrances for men and women.',null),('node','record','0','275','275','und','0','Dolores Huerta raising fist at UFW Rally, Chicago; The UFW Illinois Boycott was part of a nationwide series of boycotts that the United Farm Workers of America (UFW) spearheaded during the mid 1960s and 1970s. These boycotts alerted the national consumer of the grape and lettuce strikes that had erupted in California and other states.',null),('node','record','0','276','276','und','0','Black and white photograph of three puerto rican gang members in front of a wall of graffiti.',null),('node','record','0','277','277','und','0','Elderly man in suit, walking in front of Boycott March. The UFW Illinois Boycott was part of a nationwide series of boycotts that the United Farm Workers of America (UFW) spearheaded during the mid 1960s and 1970s. These boycotts alerted the national consumer of the grape and lettuce strikes that had erupted in California and other states.',null);
INSERT INTO `field_revision_field_description` VALUES ('node','record','0','278','278','und','0','Mujeres Latinas en Acción sent delegates from Chicago, including college age women like Nancy de los Santos, to the International Women''s Year Conference in Mexico City. The first conference of its kind, the IWY brought women from across the world together to discuss issues impacting their lives.',null),('node','record','0','279','279','und','0','9th Chicago Latino Film Festival Brochure featuring "Breaking Pan with Sol" written and directed by Nancy de los Santos. The festival took place in Chicago in 1993. ',null),('node','record','0','280','280','und','0','Black and white photograph of a girl sitting in a window sill.',null);
