INSERT INTO `field_revision_field_sat_description` VALUES ('node','satellite_project','0','27','27','und','0','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque nisl augue, pharetra sed auctor id, ultricies aliquam magna. Nullam vulputate maximus ultrices. Aliquam interdum neque vitae ex commodo, sit amet malesuada quam posuere. Donec rhoncus, ex ut lacinia vehicula, elit felis porta ligula, pulvinar pulvinar diam libero eget enim. Maecenas pulvinar vulputate enim. Quisque justo lorem, faucibus molestie mattis sagittis, ultrices ultrices risus. Curabitur sed dolor ut felis pharetra cursus. Sed pretium id mauris in euismod.</p>\r\n','','filtered_html'),('node','satellite_project','0','34','34','und','0','<p>Latina Practices of Oral History took place in Fall of 2013 at the University of Michigan. Twelve undergraduate students participated in an intensive 16 week seminar that tasked them with learning the hidden history of Chicana Feminism and asked them to help fill in the gaps in this history by recording oral histories, scanning and digitizing archives, and reflecting on the process.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Interview with Elena Herrada collected by Ari Weinberg and Grance Fisher:</strong></p>\r\n\r\n<p><iframe frameborder="0" height="500px" src="http://medici-michigan.ncsa.illinois.edu/embed.html#d?id=tag:medici@uiuc.edu,2009:data_ez9CvycfvA7zYh0Jl_0NiA" width="799px"></iframe></p>\r\n','','full_html');
